215	notes	\N	4	{"authenticity_token"=>"2-VjSTiIBVLkTS040O1uSjQ2xFnd_KZQ2D0oZmqBaiE8QF5CDLN8zcosLXyGFmzx_7W94JVPV5KqhotewsijUA", "target_type"=>"Client", "target_id"=>"489", "note"=>{"text"=>"<div>Skor - Beställt 265<br>Låda - Ja<br>Mapp - Ja<br><br>Startår -2024<br><br>Svaren på de fyra frågorna - Fick ej svar på frågorna men skrev från start att han önskade bli rörligare och bygga mer muskler för att bli en bättre golfspelare, och han har lite problem med sin vänstra axel som är \\"betydligt svagare än den högra\\".<br><br>Hur hittade personen till TAKKEI - Via Lave Beck-Friis<br><br>Övergripande Mål - Rörligare bröstrygg, smärtfri axel, ökad benstyrka (sätt så småningom viktmål inom lämpliga intervall)<br><br>Tidig/sen till träningen -I tid första passet<br><br>Långsam/medel/snabb i pass -Medel<br><br>Smärta/skador historiskt - Båtbensfraktur vänster hand för 5 år sedan.<br><br>Känsliga handleder, haft ont ibland.<br><br>Svagare vänster axel - ingen direkt skada men viktigt att ha koll på.<br><br>Smärta/skada idag -Svag (/lite stelare?) i vänster axel- risk för smärta.<br><br>Känsliga handleder - använd lindor.<br><br>Fokus: smärtfri/smidig/stark/snabb -Smidig &gt;stark men håll koll på axel och handleder.<br><br>Mediciner - Inget nämnt<br><br>Övrigt -Karl är en mycket duktig golfspelare och spelar 50-60 rundor per år (vilket är mkt i Sverige). Är på en nivå där han potentiellt hade kunnat livnära sig på golfen.<br><br>Viktigast styrkemässigt för golfspelare är att vara riktigt stark i benen/höfterna för att kunna utveckla kraft i svingen och slå långt med kontroll. Han behöver också bli rörligare i bröstryggen för att inte tappa ut svingen från toppen och träffa bollen \\"utifrån och in\\" (jag kan visa detta för ökad förståelse).<br><br>Han behöver också vara lite rädd om sina handleder som verkar vara hans svaga länk, och dessa kan slitas en del av golfen. Jag har skrivit till honom att jag tycker att han ska träna med handledslindor men att även handlederna kommer bli starkare om han sköter träningen bra (för att vara tydlig med att träningen inte är dålig för handlederna).<br><br>Han känner sig svagare i vänster axel och gissningsvis är det ett ställe där hans skulle kunna få ont om man inte trappar upp i lagom takt. Tror att det är klokt att trappa upp relativt försiktigt i tex ryck och allt över huvudet (och såklart vara noggrann med tekniken + inte köra så lätt att han tillåts lyfta dåligt) medan han kan få ta i mer rejält i tex knäböj och marklyft.<br><br>Karl är relativt stark och har mycket goda förutsättningar för en fin utveckling.<br>2024-10-29 09:52:00</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-11 21:03:08.000535	2024-12-11 21:03:08.000535	html
