317	notes	\N	3	{"authenticity_token"=>"lpuxdQW9CfBpTvNq2yJqVORK2ttYYZoFfjhtpA4Vr-eVFkDQaXP_2JOlw64FHH8YB7qvAG1WOmZd6qUgQs3LYA", "target_type"=>"Client", "target_id"=>"775", "note"=>{"text"=>"<div>Grundinfo:<br>Skor - Ja<br>Låda - Ja<br>Mapp - Ja<br>&nbsp;<br>Startår - 2022<br>&nbsp;<br>Svaren på de fyra frågorna -&nbsp;<br>&nbsp;<br>Hur hittade personen till TAKKEI - Via Emelie som tidigare tränat L på SATS<br>&nbsp;<br>Övergripande Mål - Starkare och explosivare. Succesivt komma ned i ett bekvämt huksitt efter knäoperation.<br>&nbsp;<br>Tidig/sen till träningen - I tid.<br>&nbsp;<br>Långsam/medel/snabb i pass - Medel. Ibland blir det mycket snack.<br>&nbsp;<br>Smärta/skador historiskt - Har haft problem med handleder och fotleder (inget som jag hört hon pratat om men det finns antecknat). Hon har genomgått operationer i bägge benen där man gjort ingrepp på vener samt en knäoperation. Har artros i båda knäna.&nbsp;<br>&nbsp;<br>Smärta/skada idag -&nbsp;<br>Ja, vänster knä är väldigt påverkat. Oklart om det är bara artrosen som är problemet men vi jobbar på fast anpassat. Lena är positiv och motiverad.<br><br>Fokus: smärtfri/smidig/stark/snabb - Alla.<br>&nbsp;<br>Mediciner - Ja. Hon medicinerar för hypertyreos om jag inte minns helt tokigt.<br>&nbsp;<br>Övrigt - L tränar i ett kombinerat C-varv/gymnastik just nu, hon gjorde en del anpassat hos oss i början och sedan vanlig systemträning sedan kom ett bakslag. Målet är att komma tillbaka till ett oanpassat C varv följt av ett vanligt A-varv Hon är väldigt trevlig och är väldigt mån om att göra rätt så hon frågar mycket och berättar hur hon känner i kroppen (till och med medans hon kör). Hon pratar ofta om djupet i knäböjen och att hon vill komma ner längre. Där har vi ju ett tydligt mål vi kan jobba emot.&nbsp;<br>Just nu gör Lena knäböj till 35 cm box.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-12 11:48:22.968555	2024-12-12 11:48:22.968555	html
