361	notes	\N	3	{"authenticity_token"=>"0xkNsLk79u3kFJ-Rrko2ryqhDmod_jCuul4UXgvMpzfQlPwV1fUAxR7_r1VwdCPjyVF7sSjJkM2ZjNzaRxTDsA", "target_type"=>"Client", "target_id"=>"588", "note"=>{"text"=>"<div>Grundinfo:<br>Skor - Ja s42<br>Låda - Ja s42<br>Mapp - Ja s42<br><br>Startår - 2021<br>Svaren på de fyra frågorna -<br>1. Hur ser din eventuella tränings bakgrund ut?<br>Jag har en lång och blandad tränings historik. I ung ålder (10-20+år) utövade jag flertalet sporter parallellt, Tennis 8 pass i veckan, Hockey 5 pass i veckan och fotboll 5 pass i veckan primärt. Jag var med på samtliga skollag och hade väl hyfsat flås och var en klassisk \\"bolltrollare\\".<br>Alltid varit lång och ganska stark men aldrig mycket muskler ( ej gym) Jag tävlade i tennis men mina hälsenor tog mycket stryk och jag fick till slut köra strålbehandling efter varje pass, därefter gick vänster axel sönder och jag kunde inte dra på i serve eller smash ( i övrigt gick det bra) Samma sak gäller idag om jag skulle ge mig på en hård serve men har aldrig kollat upp det.<br><br>2.Tränar du något idag? Om ja- vad och hur mycket?<br>Har inte tränat på två år snart med anledning rygg och nacke. normalt spelar jag mycket golf men har hållit mig borta från det i år , 8 rundor totalt.<br><br>3 Har du några skador eller andra hälsoproblem vi behöver känna till?<br>Nej inte mer än vad som beskrivs ovan.<br><br>4. Vad vill du att träningen ska ge dig i ett längre perspektiv?<br>Jag vill att kroppen ska fungera normalt och att jag ska kunna utöva det jag vill utan större smärtor. Initialt känns det mest prioriterat att få ordning på nacken men ryggen hänger väl ihop med det. Till vardags utanför träning har jag mest problem med nacken och då även sömnen påverkas. En dröm vore att kunna åka skidor och spela squash igen,<br><br>När man uppnått det målet kan vi fokusera på annat, såsom träning som kam ge positiv effekt på min golf eller allmän kosmetika.<br><br><br>Hur hittade personen till TAKKEI - Familj tror jag<br><br>Övergripande Mål - Smärtfri rygg och nacke<br><br>Tidig/sen till träningen - oftast sen eller precis i tid<br><br>Långsam/medel/snabb i pass -<br>långsam i uppvärmning, medel i övrigt.<br>Smärta/skador historiskt -<br>Hälsenor<br>Höger höft<br>höger knä<br>Höger ländrygg<br>Nacke<br>vänster axel ( tennis)<br><br>Smärta/skada idag -<br>Nacke<br>rygg<br>höft<br>axel<br><br>Fokus:<br>Smärtfri och stark<br><br>Mediciner -<br>inget uttalat, tar NSAID ibland mot krämpor<br>Övrigt -<br><br>Glad och positiv, lugn person . Pappa till dotter på 15 månader ( 2024) Jobbar på Ålands banken</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-12 12:22:03.19741	2024-12-12 12:22:03.19741	html
