414	bookings	2165	10	{"_method"=>"patch", "booking"=>{"client_id"=>"884", "user_id"=>"", "trainer_id"=>"10", "start_time"=>"2025-01-10 15:30:00 +0100", "room_id"=>"", "try_out"=>"false", "internal"=>"false", "education"=>"false", "internal_education"=>"false", "booking_content_id"=>"9", "id"=>"2165", "booking_without_room"=>"false"}, "mode"=>"rebook", "location_id"=>"67", "personal_message"=>"", "button"=>"", "controller"=>"bookings", "action"=>"update", "id"=>"2165"}	2024-12-12 13:47:15.625345	2024-12-12 13:47:15.625345	html
415	notes	\N	3	{"authenticity_token"=>"lGMdR4S5WaWnJnDieaDtKLUy-zkWYhWET4TSAY7Sl-bb8OiZ1nEiWSP5ooO51Iz_0-6TXy7RpSU3TqM1oJks4A", "target_type"=>"Client", "target_id"=>"603", "note"=>{"text"=>"<div>Grundinfo:<br>Skor: Ja&nbsp;<br><br>Låda: ja&nbsp;<br><br>Mapp: ja&nbsp;<br>&nbsp;<br>Mål generellt: starkare, inte minst i ben för tex löpning och för att knän ska hålla. Kör mkt yoga, paddlar och fjällvandrar.<br><br>&nbsp;<br>Smärtfri –&nbsp;<br><br>Hon har känt av ett knä till och från sedan några år tillbaka, detta berodde på stelhet i muskler runt knät på framsida och insida lår har jag för mig men går lite fram och tillbaka. Efter att ha vart i fjällen och gått i skare så fick hon ont igen.&nbsp; 2023-Mkt bättre med knät<br><br>Hon är överlag inte påverkad av knät, dock kan vi inte bara dundra på med vikter eftersom hon inte haft lika mycket belastning på kroppen , knäböj ska hon bara göra till 90 grader samt inga knäböjshopp i uppvärmningen eller S3, ersätt med explosiv knäböj press i både uppvärmning ( pinne) och i serie 3 med stång. Hon kan hoppa i lyften men något blir knasigt med landningen i KBhopp med sträck m pinne+s3 som gör att hon så får direkt ont i knät.&nbsp;<br><br>Har tidigare&nbsp; opererat in ett band i bäckenbotten för att åtgärda en förlossningsskada som hon dragits med i 20 år. Det var ett enkelt ingrepp som har gått jättebra och hon ska vara helt återställd,<br>&nbsp;<br>Har även haft post covid besvär samt vissa klimakterie besvär men nu får hon hormoner och mår mycket bättre! Fick covid igen 2023 och besväras fortfarande av symtom så som feber och trötthet.<br><br>&nbsp;<br>Smidig – God rörlighet i ben men mindre i bröstrygg-axlar.&nbsp;<br><br>Stark – Får hon kontinuitet i träningen så svarar hon bra och blir starkare.&nbsp;<br><br>Snabb – uthållig så blir snabb av den anledningen, Men explosivitet behöver lite mer jobb - har dock fått mycket mer tryck i kroppen sen det upptäcktes att hon hade ett magsår, vilket såklart stressade kroppen samt att hon då inte åt så mycket pga smärtan.&nbsp;<br><br>Startår: Tränade hos oss för många år sedan för att sedan ha långt uppehåll. Kom igång igen i år efter att ha fått ett presentkort av Eva Redhe.<br>&nbsp;<br>Mediciner:&nbsp; progesteron och östrogen - osäker vilken form eller vad de preparaten heter, finns lite olika.&nbsp;<br>&nbsp;<br>Tidig/sen till träningen: Brukar vara precis i tid<br><br>Långsam/medel/snabb genom passet: Ganska snabb.<br><br>Bokningar framöver: Ja, måndagar 16:30<br><br>Övrigt: &nbsp;<br><br>Håll koll på TP i fot, och att hon inte står för smalt i KB, ca axelbrett är lagom. Samt att hon ska jobba utåt i knäna för att få TP i mitten. Samt 90 grader<br><br>Hon tränar även en gång i veckan med en annan PT, de tränar med andra saker än vad vi gör.&nbsp;<br><br>Beata gillar enkla instruktioner att förhålla sig till.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-12 13:48:11.420767	2024-12-12 13:48:11.420767	html
