åendet.<br>&nbsp;<br>Övrigt – Hela hennes familj tränar hos oss, Pettersson, äger Hotel Frantz och Ruth. Från östergötland men bott i sthlm några år.&nbsp;<br><br></div><div><br><br></div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-13 14:18:10.559428	2024-12-13 14:18:10.559428	html
