855	notes	\N	3	{"authenticity_token"=>"9Qdk9k4Ahf81IWTRTIreoG7AZ-cQ8QQToi13ftH2PwbgGbEZZsbdYv61RXGJRQY-zfI3Ny9FN_L5i0V9djNV4Q", "target_type"=>"Client", "target_id"=>"905", "note"=>{"text"=>"<div>Grundinfo<br>Skor - Ja, strl 40<br>Låda - Ja<br>Mapp - Ja<br><br>Startår - 2024<br><br>Svaren på de fyra frågorna -&nbsp; Spelar padel/tennis 2-3 ggr/v och gillar att åka skidor. Tränar med PT en gång i veckan, med fokus på rörlighet. Önskar bli mer smidig, stark och explosiv<br><br>Hur hittade personen till TAKKEI - via Charlotte Nordenfalk<br><br>Övergripande Mål - rörligare bröstrygg, inte minst för att avhjälpa smärta i höger axel. Smidigare, starkare, snabbare för padel/tennis/skidor<br><br>Tidig/sen till träningen -&nbsp; I tid<br><br>Långsam/medel/snabb i pass - medel<br><br>Smärta/skador historiskt - opererat främre korsband vänster knä&nbsp; 2017 efter skada vid skidåkning. Inga problem idag. Kan ibland känna av höger axel. Haft problem med tennisarmbåge som nu är borta men vi är noggranna med positioner och nedtagning samt belastning.<br><br>Smärta/skada idag - kan ibland känna av höger axel&nbsp;<br><br>Fokus: smärtfri/smidig/stark/snabb - till att börja med smärtfri axel, rörligare bröstrygg/fotleder<br><br>Mediciner - inget vi vet<br><br>Övrigt - arkitekt som driver eget och arbetar hemifrån. Har tre barn 21, 19 och 13 år 2024. Inga gravkomplikationer men känner sig svag i magen.&nbsp;<br><br>Tar instruktioner bra, har överlag bra kroppskontroll och kommer få fin utveckling.&nbsp;<br><br>Något stel bröstrygg och fotleder (upplever själv korta hälsenor) så fick jobba en del för att behålla en ryckfixering i RKB under provträningen.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-16 16:03:48.154621	2024-12-16 16:03:48.154621	html
