1890	notes	\N	3	{"authenticity_token"=>"yQCZPrx3HR7lFimfRpxyqrNyG5aao_zusCppBToaji3ciU8n_WQuxPoU3RIXVPZcus644G7srQJcrAEDB8RcJw", "target_type"=>"Client", "target_id"=>"931", "note"=>{"text"=>"<div>Grundinformation<br><br></div><div>Skor - ja 38 2/3 (240)<br>Låda -kommer ombytt<br>Mapp - ja<br><br>Startår - 2024<br><br>Svaren på de fyra frågorna -<br>1) Hur ser din eventuella träningsbakgrund ut?<br>Tränat med PT innan covid. Kört en del crossfit för många år sedan.&nbsp;<br><br>2) Tränar du något idag? Om ja - vad och hur mycket?<br>Lite styrketräning sen i höstas. Mest maskiner.&nbsp;<br>Lite yoga<br>Dansklass ibland<br>Spelar golf regelbundet&nbsp;<br><br>3) Har du några skador eller andra hälsoproblem vi behöver ta hänsyn till?<br>Gamal skada i ryggen.&nbsp;<br>Vä knä kan smärta ibland.&nbsp;<br>Kan värka lite i ryggen ibland om jag sitter för länge&nbsp;<br><br>4) Vad vill du att träningen ska ge dig i ett längre perspektiv?<br>Känner att jag behöver bli starkare och vill gå ner i vikt.&nbsp;<br><br>Hur hittade personen till TAKKEI -<br>Via en kund på T19, Ylva Stazewski. De träffades på en golfresa.&nbsp;<br><br>Övergripande Mål - starkare överlag<br><br>Tidig/sen till träningen -&nbsp; i tid&nbsp;<br><br>Långsam/medel/snabb i pass - Medel<br><br>Smärta/skador historiskt - Föll som 15-åring i en trappa och skadade bröstryggen. En kota är idag hälften så stor som den annars skulle ha varit. Hon kan känna av ryggen ibland.<br><br>Smärta/skada idag -&nbsp;<br>Vänster knä kändes okej under provträningen.&nbsp; Och har ej känts av i övrigt.<br>Uppdatering:<br>Försvagad Bäckenbotten, förmodligen efter förlossning. Osäker om skada eller ej men ska gå till gynekolog i Sthlm för utredning. Bäst att lyft körs omvänt ner till p3/p4.( mer skonsamt, skapar inte lika högt tryck) &nbsp;Vi jobbar djup i knäböj mot box framöver istället för att öka belastning.<br><br>Fokus: smärtfri/smidig/stark/snabb -<br>1.SMIDIG &nbsp;och 2.STARK&nbsp;<br><br>Mediciner - progesteron och östrogen mot klimakterie besvär.&nbsp;<br><br>Övrigt - Bor i Varberg men jobbar här i Stockholm. Övernattningslägenhet. Har 2 vuxna barn. Dedikerad golfare.&nbsp;<br>Är här Måndag till torsdag.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 07:15:29.562933	2024-12-30 07:15:29.562933	html
