2028	notes	\N	5	{"authenticity_token"=>"K3APwQHXOUoWbAO9CIX5cmyyf0DTKKbHLcP5FyIJToZxe_Rg5JWxR0PacVhaS-skZn1CGTZdpcGqOVFRH8ZCfA", "target_type"=>"Client", "target_id"=>"837", "note"=>{"text"=>"<div>Skor - G7<br>Låda - G7<br>Mapp - G7<br>&nbsp;<br>Startår - 2015<br>&nbsp;<br>Svaren på de fyra frågorna - Fanns inte på den tiden<br>&nbsp;<br>Hur hittade personen till TAKKEI - Osäker. Tror att det kan ha varit via Jonas Engvall.<br>&nbsp;<br>Övergripande Mål - Kontinuitet från min sida (Trillar lätt ur loopen). Annars handlar träningn mycket om att&nbsp; konservera och förbättra styrka, rörlighet och balans för vardagsfunktion. Nils gillar racketidrott och vill ha en kropp som håller för det.<br>&nbsp;<br>Tidig/sen till träningen - Kommer precis till passet och är oftast lyftklar ca 10 minuter efter utsatt tid.<br>&nbsp;<br>Långsam/medel/snabb i pass - Långsam. Ibland kan han dock få små ryck och speeda på tempot.<br>&nbsp;<br>Smärta/skador historiskt -&nbsp;<br><br>* Har historiskt haft känsliga knän. Bytte ut höger knäled mot en protes september 2021. Efter operationen fick han viss nervpåverkan som gör att han saknar känsel i höger häl. Ingen smärta men påverkar balansen på ett ben.<br>* Axlar skuldra känsligt periodvis.<br>* Opererades 2020 för ett hjärtfel. Operation var framgångsrik.<br>* Är i det åldersspannet då olika småkrämpor och tillstånd i kroppen kombinerat med bondförkyln<br>&nbsp;<br>Smärta/skada idag -&nbsp; I regel smärtfri. Kan dock komma in med småskavanker efter tennis eller om han har burit och fixat på landet.<br><br>&nbsp;Fokus: Generellt smidig och stark.&nbsp; Nils upplever att balansen blir sämre med åren.<br>&nbsp;<br>Mediciner - Blodförtunnande<br><br>Övrigt-<br><br>VIKTIGT- LIGG INTE PÅ FÖR HÅRT ELLER GASA GENOM PASSET!<br><br>* Nils är en av fyra grundare för BASID. Sysslar med att utveckla varumärken. Är utåtriktad och en entreprenör-personlighet.<br>* Flera barn och ett barnbarn. Hus på Torö.<br>* Gillar som sagt tennis.<br>* Ganska lång och gänglig. Skulle behöva bli starkare och få en mer solid struktur i kroppen.&nbsp;<br>* Älskar att träna mage.&nbsp;<br>* Musikintresse. Kom på det när vi av en slump gick på varandra på ett Alice Cooper gig :)</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2025-01-01 12:59:52.130692	2025-01-01 12:59:52.130692	html
