956	notes	\N	3	{"authenticity_token"=>"agdiaOqhZA7kluUPPqt0yIU7BDo9vQKZCtIJDVV3jo6mPwz9Q8J0ejWQ00_c7hG5DeI_AeKJIZy5_YeEuwdoxg", "target_type"=>"Client", "target_id"=>"735", "note"=>{"text"=>"<div><br>Grundinformation<br><br></div><div>Skor - Ja&nbsp;<br>Låda - Ja<br>Mapp - Ja<br><br>Startår - 2012&nbsp; (kanske tidigare)<br><br>Svaren på de fyra frågorna - Fanns ej när hon började.&nbsp;<br><br>Hur hittade personen till TAKKEI - Vet inte faktiskt<br><br>Övergripande Mål - Stark och hel för livet och löpning<br><br>Tidig/sen till träningen - Oftast ca 5 minuter innan.&nbsp;<br><br>Långsam/medel/snabb i pass - Ganska snabb<br><br>Smärta/skador historiskt - Diskbråck nacke 2013, Löparknä 2014, Ont i benhinnor vid löpning 2020. Känt av axlar och rygg efter graviditet. Men inget av detta ovanstående känns av idag.&nbsp;<br><br>Smärta/skada idag -<br>Diskbråck i bröstryggen, förmodligen triggat av att hon setat ner väldigt mycket under en utdragen rättegångsprocess. Vi tränar anpassat och allt går enligt plan framåt. Har nu fått godkänt att löpträna&nbsp;<br><br>Fokus: smärtfri/smidig/stark/snabb - Denna snurra är fokus på stort rörelseomfång. M är ganska stark men samtidigt stel i kroppen. Senaste året har vi jobbat med skumblocken för att successivt ta kroppen till nytt djup&nbsp; i knäböjen. Det har verkligen hjälpt. Idén är att vänja kroppen långsamt och göra 2,5cm djupare för varje snurra. Efter 18 veckor så är alltså tanken att ta ned djupet ytterligare 2,5cm.&nbsp;<br><br>Mediciner - Inte vad jag känner till.&nbsp;<br><br>Övrigt -<br>Härlig person. Har tre barn, varav ett tränar hos oss (Elsa). Sista barnet är född 2020.&nbsp; Vi har som sagt nu lagt extra fokus på att göra djupare knäböj där skumblocken hjälper henne att känna sig trygg att komma ned djupare. Hon säger att hon inte skulle gå så djupt om det inte var så att något fångar upp henne om hon går för långt. Största utmaningen för M är rörligheten för att ha stången över huvud. Lättare med ryckgrepp än stöt att ha raka armar.&nbsp; Maria är en väldigt trevlig, snäll, ödmjuk och härlig person, och väldigt tacksam och rolig att träna. Hon är analytisk och förstår lyften väl. Är mkt kontinuerlig i sin träning förutom lite semesteruppehåll ibland, och vill alltid få in ett extra pass om hon missar ett annat. Springer en del på sin fritid.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-17 11:40:09.43865	2024-12-17 11:40:09.43865	html
