985	notes	\N	3	{"authenticity_token"=>"ss1uw3BnA0EHAUanfnGD7gaSWRGaytNMF0X6U7QIkXHGWQVnVMdEHp4gmUGAIhYgpvph8-yrtUNF2EIZR05XnA", "target_type"=>"Client", "target_id"=>"706", "note"=>{"text"=>"<div><br>Grundinformation<br><br></div><div>Skor - Ja (på S42 - som låna någon gång så är det 280)<br>Låda - Ja (på S42)<br>Mapp - Ja (på S42)<br><br>Startår - 2016 (uppehåll i två år och tillbaka igen december 2023)<br><br>Svaren på de fyra frågorna - Fanns ej då<br><br>Hur hittade personen till TAKKEI - Via Victor Jacobsson.<br><br>Övergripande Mål - Smärtfritt högerknä. Bättre hållning.<br><br>Tidig/sen till träningen - Nästan alltid i tid och han är väldigt snabb på att byta om.<br><br>Långsam/medel/snabb i pass - Han inser att när han kan prata mkt så har han vilat färdigt :)<br><br>Smärta/skador historiskt - Höger knä (från att han började hos oss), rygg nacke i perioder efter att ha burit och lyft barn i knasiga vinklar (blev pappa 2018 och har nu fyra barn). Ont i ena skuldran (apr. 2020)<br><br>Smärta/skada idag - Inget har märkts under de fyra passen vi har kört sedan han kom tillbaka mer än en liten sträckning i ljumsken&nbsp; i MSU i 0:1 (gick snabbt över).<br><br>Fokus: smärtfri/smidig/stark/snabb - Bygga upp styrkan igen och jobba på farten - våga ta i. Han är smidig men kan inte få till hyllan och man kan få påminna om armbågar fram i RKB.<br><br>Mediciner - Inte vad jag vet<br><br>Övrigt - Martin är född 1980 och är nybliven fyrabarnspappa (fick tvillingar för ca 4 månader sedan och har sedan innan Sigrid 5 år och Ossian 3 år). Frun heter Emelie. De har bott två år i Polen därav paus från Takkei (frun jobbar på UD). De bor alldeles vid S42. Han kan lida av sömnbrist och vara lite sliten iom vakande timmar på natten. Han känner bl.a. paret Nicolin som också tränar hos oss.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-17 13:55:11.632904	2024-12-17 13:55:11.632904	html
