1053	bookings	\N	4	{"authenticity_token"=>"LhR1DuyQPC3I-4MXZzNm0iUdDJs61CU4hlCNuODK4h_nGOPERCtPT4iEgKSJvF8c0FbxrFu8n86QSs6EjjKn-g", "subject"=>"Bokningsbekräftelse Takkei", "client_id"=>"584", "mail_to"=>["johan.Regefalk@kgk.se", "Simon.petersson@takkei.se"], "mailtext"=>"Hej Johan, \\n\\nHär kommer en bekräftelse med alla tider vi bokat in. Tisdag jan 7, kl 17.30 fanns tillgänglig med Emelie, så jag bokade den. Blir det bra? Vi ses för sista gången detta år nu på lördag, sen träffar du Viktor två gånger och sen ses vi igen den 4 jan. \\n\\nSer fram emot ett träningsfyllt 2025!\\n\\n2024-12-21 kl. 15:30 på Sibyllegatan 42\\n2024-12-26 kl. 08:30 på Tegnérgatan 19 (OBS torsdag på Tegnérgatan med Viktor)\\n2024-12-28 kl. 15:30 på Sibyllegatan 42 (Viktor)\\n\\n2025-01-04 kl. 15:30 på Sibyllegatan 42\\n2025-01-07 kl. 17:30 på Sibyllegatan 42 (OBS tisdag med Emelie)\\n2025-01-11 kl. 15:30 på Sibyllegatan 42\\n2025-01-18 kl. 15:30 på Sibyllegatan 42\\n2025-01-25 kl. 15:30 på Sibyllegatan 42\\n2025-02-01 kl. 15:30 på Sibyllegatan 42\\n2025-02-08 kl. 15:30 på Sibyllegatan 42\\n2025-02-15 kl. 15:30 på Sibyllegatan 42\\n2025-02-22 kl. 15:30 på Sibyllegatan 42\\n2025-03-01 kl. 15:30 på Sibyllegatan 42\\n2025-03-08 kl. 15:30 på Sibyllegatan 42\\n2025-03-15 kl. 15:30 på Sibyllegatan 42\\n2025-03-22 kl. 15:30 på Sibyllegatan 42\\n2025-03-29 kl. 15:30 på Sibyllegatan 42\\n2025-04-05 kl. 15:30 på Sibyllegatan 42\\n2025-04-12 kl. 15:30 på Sibyllegatan 42\\n2025-04-19 kl. 15:30 på Sibyllegatan 42\\n2025-04-26 kl. 15:30 på Sibyllegatan 42\\n2025-05-03 kl. 15:30 på Sibyllegatan 42\\n2025-05-10 kl. 15:30 på Sibyllegatan 42\\n2025-05-17 kl. 15:30 på Sibyllegatan 42\\n2025-05-24 kl. 15:30 på Sibyllegatan 42\\n2025-05-31 kl. 15:30 på Sibyllegatan 42\\n2025-06-07 kl. 15:30 på Sibyllegatan 42\\n2025-06-14 kl. 15:30 på Sibyllegatan 42\\n\\nDu kan boka av eller om din träningstid senast klockan 12.00 dagen innan träning genom att kontakta någon i ditt tränarteam via sms, epost eller telefon.\\n