1054	clients	962	3	{"_method"=>"patch", "set_notifications"=>"yes", "trail"=>"", "internal"=>"", "client"=>{"firstname"=>"Nina", "lastname"=>"Linander", "email"=>"nina.linander@gmail.com", "alternative_email"=>"", "person_number"=>"590210-4040", "phone"=>"+46703036660", "primary_trainer_id"=>"3", "active"=>"true"}, "notifications"=>["Email"], "button"=>"", "controller"=>"clients", "action"=>"update", "id"=>"962"}	2024-12-17 18:35:22.844228	2024-12-17 18:35:22.844228	html
1055	notes	\N	3	{"authenticity_token"=>"xnrOPaJEmpqJhR_j-kZHA_nA0NKZcZVNvMWbn0K75FFzTa5y0RUNUQtYCcm1mGEGWaKIN4HwFlKlywETvsy9Jg", "target_type"=>"Client", "target_id"=>"962", "note"=>{"text"=>"<div><br>Grundinformation<br><br></div><div>Skor - Ja<br>Låda - Kommer ombytt<br>Mapp - Ja<br><br>Startår - 2024<br><br>Svaren på de fyra frågorna -<br>1) Hur ser din (eventuella) träningsbakgrund ut? &nbsp;<br>Brukar träna regelbundet men mest pilates, garuda, jogging och långa promenader. Har inte varit på gym sen före covid. I februari fick jag dubbelsidig lunginflammation, tre penicillinkurer och var sjuk i tre och en halv månad. Dessutom bröt jag tre revben av hostan, vilket gjorde att jag var försiktig med att göra saker som påverkade läkningen. Har efter det jobbat på att få upp andningen via promenader. Har under hösten försiktigt börjat med garuda och pilates igen, men inte så ofta som jag brukar/vill. Har även gett mig ut i joggingspåret några gånger.<br><br>Gjorde även en undersökning om benskörhet då läkaren funderade på om det kunde ha medverkat till mina brutna revben. Dock visade testen att jag inte hade benskörhet. Läkaren gav mig dock råd att börja med styrketräning för att förhindra eventuell benskörhet framöver.<br><br>2) Tränar du något idag? Om ja - vad och hur mycket? &nbsp;<br>Alldeles för lite. Pilates och garuda samt joggar ibland. Men går långa promenader regelbundet och vandrar gärna i naturen.<br><br>3) Har du några skador eller andra hälsoproblem vi behöver ta hänsyn till? &nbsp;<br><br>Se ovan under 1.<br><br>4) Vad vill du att träningen ska ge dig i ett längre perspektiv? &nbsp;<br>God hälsa, styrka för vardagen samt bättre balans.<br><br><br>För din info är jag 65 år men förutom ovan är jag frisk.<br><br>Hur hittade personen till TAKKEI - Genom sin vän Anna lundh, men även Ninas syster Eva Linander som även hon är klient hos oss.<br><br>Övergripande Mål -<br>styrka för vardagen samt bättre balans.<br><br>Tidig/sen till träningen - I tid<br><br>Långsam/medel/snabb i pass -&nbsp; medel<br><br>Smärta/skador historiskt -<br>Brutna revben efter lunginflammation februari 2024, detta har läkt och bör ej vara ett problem. Ramlade och bröt revbenen igen samt fick sy i pannan i oktober och började om prep period i december.&nbsp;<br><br>Smärta/skada idag -<br><br>Fokus: stark&nbsp;<br><br>Mediciner - Inga uttalade<br><br>Övrigt -<br>Vi frågar alltid kvinnor kring om de har fött barn hur förlossning gick och hur bäckenbotten har blivit påverkad efter. Nina genomgick ett kejsarsnitt&nbsp; för sina tvillingar. Är idag halvinkontinent, värt att tänka på i träningen att jobba med andning och att hitta rätt lyft i bäckenbotten vid tyngre och explosivare moment om det är så att läckage uppstår. samt långsamt stegra belastning.<br><br>I övrigt mycket härlig person att träna och tar instruktioner väl.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-17 18:41:42.460702	2024-12-17 18:41:42.460702	html
