1058	notes	\N	3	{"authenticity_token"=>"6oAs7yuhFtJJ5-RZnQsGrfTWzuoW7NV9PMwOGcBF0tpft0ygWPCBGcs68nPS1SCoVLSWDw5tVmIlwpSVPDKLrQ", "target_type"=>"Client", "target_id"=>"898", "note"=>{"text"=>"<div><br>Grundinformation<br><br></div><div>Skor – ja&nbsp;<br>storlek 250<br><br>Låda – ja<br><br>Mapp – ja<br>Startår - 2024<br><br>Svaren på de fyra frågorna –<br><br>1) Hur ser din&nbsp; (eventuella) träningsbakgrund ut? &nbsp;<br>Jag var i min bästa form mellan 2015-2018. Då tränade jag med PT, gjorde yoga och tränade på Barrys bootcamp. Jag åkte också skidor utför 3-4 veckor per år.&nbsp;<br>2018 började jag få symptom som gjorde att jag inte kunde träna längre. Jag hade feber 1-2 gånger i månaden och gick ner i vikt. 2021 fick jag tillslut diagnosen addisons sjukdom och började äta hydrokortison. Då blev jag bättre men jag gick upp i vikt. Nu sedan drygt ett år tillbaka har jag en ny medicin som jag mår mycket bättre av.<br>Jag har tränat med många PT genom åren och är i grunden en aktiv person.&nbsp;<br><br>2) Tränar du något idag? Om ja - vad och hur mycket?<br>Jag fick mitt tredje barn i augusti och har deltagit i en mammaträningsgrupp i november och december. Två gånger i veckan. Dock missade jag mycket pga sjukdomar.&nbsp;<br><br>3) Har du några skador eller andra hälsoproblem vi behöver ta hänsyn till?<br>Inga skador. Jag har några autoimmuna sjukdomar bla addisons som innebär att jag inte har någon egenproduktion av kortisol. Jag ersätter detta med hydrokortison som jag äter varje dag. Vid stress måste jag uppdosera men det finns inget test man kan ta för att se hur mycket jag behöver. Jag måste känna efter själv när jag är ”låg” i kortisolet, vilket är svårt ibland. Träning är ju en form av stress.<br><br>4) Vad vill du att träningen ska ge dig i ett längre perspektiv?<br>Jag vill känna mig stark och pigg. Jag har som sagt 3 barn (11 år, 2 år och 4 månader) som jag vill lära att åka skidor och leka med.&nbsp;<br><br><br>Hur hittade personen till TAKKEI –<br><br>Björn och Måns hade en föreläsning för ett företag som heter FCG. Hon var konsult där då och lyssnade på föreläsningen. Nu, ungefär fem år senare hörde hon av sig och ville börja ?<br><br>Övergripande Mål – Öka generell styrka. Flåset kommer sannolikt förbättras på köpet.&nbsp;<br><br>Tidig/sen till träningen – Varit ca 10 minuter tidig inför de två träningar hon gjort.&nbsp;<br><br>Långsam/medel/snabb i pass - Medel<br><br>Smärta/skador historiskt – Diskbråck i ländryggen men som hon inte känner av idag. Knäna har historiskt känts av litegrann, så där kan man nog vara lite vaksam så att det inte blir för mycket för snabbt. Hon upplever att vi ”tränar mycket ben här”.&nbsp;<br><br>Smärta/skada idag – Hon har känningar i nacken och det verkar hon påverkas av litegrann i vardagen av också. Främst när hon sitter vid dator.&nbsp;<br>Uppdatering: I oktober fick Lina ryggskott hemma och efter det konstaterades även&nbsp; ett diskbråck i nacken. Vi undviker vikt över huvud under några perioder, vi har sen dess tränat gymnastik. Nu känner sig lina redo för att börja med vanlig styrka igen och vi kommer inleda med ett C-varv.&nbsp; i prep i a varv höll jag ner MYCKET med fokus på att inte belasta för mycket men jag tror vi ändå får gå över på C varv men även där anpassa den totala volymen&nbsp;<br><br>Fokus: smärtfri/smidig/stark/snabb – Generell styrka skulle jag säga är fokus här.&nbsp;<br><br>Mediciner – JA, VIKTIGT.&nbsp; hydrokortison och fludrokortison. Läs hennes svar på de fyra frågorna.&nbsp;<br><br>Övrigt – Mitt första intryck under provträningen var att vi bör vara försiktigt och balansera ansträningsnivån så att vi har marginal här. Både med tanke på hennes autoimmuna sjukdomar men också för att hon inte tränat på länge. Det här intrycket förstärktes under 0:1 då hon fick som en liten ”sträckning” i sätet i första omgången enbensryck. Hon sa att det bara är värk för att hon är otränad. Men det var nog en liten sträckning. Vi kunde köra på men startade ovanför knät istället för under, kommande två set och det fungerade. Resten av passet gick bra. Förra träningen var första gången hon ansträngde sig så hårt sedan våras. Jag tycker att vi ska vara väldigt försiktigt med att höja vikterna här utan se prep perioden för vad den är – förbereda henne för den här typen av träning. Hon kommer säkert ha mer kapacitet än vikterna som är satta men hennes tolerans för vikterna behöver vi ta hänsyn till.&nbsp;<br>Ska bli kul att följa hennes träningsresa på lång sikt! Superhärlig och social person. Bor i norra Djurgårdsstan.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-17 18:49:12.339054	2024-12-17 18:49:12.339054	html
1059	bookings	\N	3	{"booking"=>{"client_id"=>"898", "user_id"=>"", "trainer_id"=>"3", "start_time"=>"2025-01-08 09:30:00 +0100", "room_id"=>"", "try_out"=>"false", "internal"=>"false", "education"=>"false", "internal_education"=>"false", "booking_content_id"=>"9", "id"=>"", "booking_without_room"=>"false"}, "mode"=>"book", "location_id"=>"70", "send_email"=>"yes", "personal_message"=>"Hej Karolina, Här är dina bokningar för vårterminen, hör av dig om något ska bokas om. Vi ses imorgon! \\n\\n", "repeat_time"=>"yes", "repeat_no_of_weeks"=>"23", "repeat_times"=>["2025-01-15 09:30", "2025-01-22 09:30", "2025-01-29 09:30", "2025-02-05 09:30", "2025-02-12 09:30", "2025-02-19 09:30", "2025-02-26 09:30", "2025-03-05 09:30", "2025-03-12 09:30", "2025-03-19 09:30", "2025-03-26 09:30", "2025-04-02 09:30", "2025-04-09 09:30", "2025-04-16 09:30", "2025-04-23 09:30", "2025-04-30 09:30", "2025-05-07 09:30", "2025-05-14 09:30", "2025-05-21 09:30", "2025-05-28 09:30", "2025-06-04 09:30", "2025-06-11 09:30", "2025-06-18 09:30"], "button"=>"", "controller"=>"bookings", "action"=>"create"}	2024-12-17 18:53:17.791759	2024-12-17 18:53:17.791759	html
1060	notes	\N	3	{"authenticity_token"=>"ufjfyjGx9C17K49U-MZ1Agexyp679gB_drsyP3itPhoMz7-FQuBj5vn2mX63GFMHp9OSe6N3g2BvtaizhNpnbQ", "target_type"=>"Client", "target_id"=>"578", "note"=>{"text"=>"<div><br><strong>Grundinformation</strong><br><br></div><div>Skor - Ja<br>Låda - Nej<br>Mapp - Ja<br><br>Startår - 2022<br><br><strong>Svaren</strong><em> </em><strong>på</strong><em> </em><strong><em>de</em></strong><em> </em><strong>fyra</strong><em> </em><strong>frågorna</strong><em> -</em><br><em>Hur ser din träningsbakgrund ut?</em><br>Rört på mig mycket men aldrig varit toktränad vad gäller muskler. Löpning, Tennis, Padel, Yoga mest<br><br><em>Hur</em> <em>ser din eventuella träning ut idag?</em><br>Gör något varje dag minst en aktiv promenad eller yoga. Jag springer ca 2 gånger i veckan, spelar padel 1-2 gånger i veckan och yogar kanske 3. Yogan är mest Vinyasa.<br><br><em>Har du några skador eller andra hälsoproblem som vi behöver veta om?</em><br>Börjat känna av vänster höft, nedre delen av ryggen när jag sprungit el spelat för mkt padel.<br><br><em>Vad har du för mål med din träning på lite längre sikt?</em><br>Jag vill bygga upp en bättre core styrka och styrka överlag. Vill pusha mig själv och bli starkare och få bättre kondition. Bygga en bra grund så jag inte skadar mig när jag springer och spelar padel/tennis<br><br><strong>Hur hittade personen till TAKKEI -</strong><br>Gift med Johan Reventberg som tränar på S42 sedan 2020<br><br><strong>Övergripande Mål -</strong><br>Vill bygga upp en styrka överlag. Även få bättre kondition. Bygga en bra grund så att hon inte skadar sig när hon springer och spelar padel/tennis<br><br><strong>Tidig/sen till träningen - </strong><br>Brukar vara i tid<br><br><strong>Långsam/medel/snabb i pass</strong> - Medel<br><br><strong>Smärta/skador historiskt -</strong><br>När hon började hos oss så kunde hon känna av en viss smärta i höften och nedre delen av ryggen men det känns inte av längre<br><br><strong>Smärta/skada idag - </strong><br>Skulle säga att hon är smärtfri nu <br><br><strong>Fokus</strong>: smärtfri/smidig/stark/snabb - Styrka i stort rörelseomfång.<br><br><strong>Mediciner</strong> - Inget uttalat, men viktigt att veta är att Hanna har en hörselskada (tydligen någon hormonrelaterad tillväxt i örat som drabbar relativt många kvinnor 40+) och därför har hörapparater på båda öronen. Hon hör en inte alls om man pratar bakom henne eller från sidan, så det är viktigt att placera sig rätt och prata högt och tydligt. &nbsp;<br><br>Uppdatering: har opererat ena örat så nu hör hon normalt på det. Ska operera andra örat framåt nån gång också.&nbsp;<br><br>Övrigt - Har som sagt hörapparat på ena örat , så att tala tydligt och placera sig rätt i rummet är viktigt. Väldigt trevlig och klok. Älskar små tips att förhålla sig till i tekniken och är duktig på att ta till sig dem. Känns som att hon förstår skillnad på träning och träning!&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-17 19:00:23.374976	2024-12-17 19:00:23.374976	html
1061	notes	\N	3	{"authenticity_token"=>"H9KBCa85nc-JBLlazWYzTQwmZlUp8RafWJNvAmP3bcWq5eFG3GgKBAvZr3CCuBVIrEQ-sDFwlYBBnfWOn4A0sg", "target_type"=>"Client", "target_id"=>"931", "note"=>{"text"=>"<div><br>Grundinformation<br><br></div><div>Skor - ja 38 2/3<br>Låda -kommer ombytt<br>Mapp - ja<br><br>Startår - 2024<br><br>Svaren på de fyra frågorna -<br>1)\\tHur ser din eventuella träningsbakgrund ut?<br>Tränat med PT innan covid. Kört en del crossfit för många år sedan.&nbsp;<br><br>2)\\tTränar du något idag? Om ja - vad och hur mycket?<br>Lite styrketräning sen i höstas. Mest maskiner.&nbsp;<br>Lite yoga<br>Dansklass ibland<br>Spelar golf regelbundet&nbsp;<br><br>3)\\tHar du några skador eller andra hälsoproblem vi behöver ta hänsyn till?<br>Gamal skada i ryggen.&nbsp;<br>Vä knä kan smärta ibland.&nbsp;<br>Kan värka lite i ryggen ibland om jag sitter för länge&nbsp;<br><br>4)\\tVad vill du att träningen ska ge dig i ett längre perspektiv?<br>Känner att jag behöver bli starkare och vill gå ner i vikt.&nbsp;<br><br>Hur hittade personen till TAKKEI -<br>Via en kund på T19, Ylva Stazewski. De träffades på en golfresa.&nbsp;<br><br>Övergripande Mål - starkare överlag<br><br>Tidig/sen till träningen -&nbsp; i tid&nbsp;<br><br>Långsam/medel/snabb i pass - Medel<br><br>Smärta/skador historiskt - Föll som 15-åring i en trappa och skadade bröstryggen. En kota är idag hälften så stor som den annars skulle ha varit. Hon kan känna av ryggen ibland.<br><br>Smärta/skada idag -&nbsp;<br>Vänster knä kändes okej under provträningen.&nbsp; Och har ej känts av i övrigt&nbsp;<br><br>Fokus: smärtfri/smidig/stark/snabb -<br>Smidig och stark&nbsp;<br><br>Mediciner - progesteron och östrogen mot klimakterie besvär&nbsp;<br><br>Övrigt - Bor i Varberg men jobbar här i Stockholm. Övernattningslägenhet. Har 2 vuxna barn. Dedikerad golfare.&nbsp;<br>Är här Måndag till torsdag.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-17 19:02:07.548992	2024-12-17 19:02:07.54899