nnes man jobbar mycket (plastkirurg) och de har bara svärmor som hjälp med barnen så vid vab är det Anna som behöver rycka in (risk för avbok). Hon är ledig fredagar och kommer att få svårt att få in pass på annan dag.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 14:25:11.694422	2024-12-30 14:25:11.694422	html
