2032	notes	\N	5	{"authenticity_token"=>"AUtaLB9pNqPp7ou0gVoKrPiGR2ZW-lw7VvmQhSFU1e9bQKGN-iu-rrxY-VHTlBj68kl6P7OPXz3RAzjDHJvZFQ", "target_type"=>"Client", "target_id"=>"531", "note"=>{"text"=>"<div>Skor - G7<br>Låda - G7<br>Mapp - G7<br>&nbsp;<br><strong>Startår:</strong> 2023<br> <br><strong>Svaren på de fyra frågorna:<br></strong><br>- I ungdomens vår friidrott på klubbnivå Turebergs IF, 400 m, höjd, längd.<br>- Militär femkamp i lumpen, regementslaget Svea Livgarde <br>- Tre Lidingölopp 30 km <br>- Tre Vasalopp öppet spår (bästa tid 6 tim 45 min med Sture)<br>- Stockholm Maraton och ett antal halvmaratonlopp<br>- Vikingarännet Uppsala - Stockholm skridskor<br>- Gubbtennis som motion, jogg och skidor motionsspåren under tiden i Hudik<br>- Fram till pandemin under ca 12 år gruppgympa Sturebadet samt gym<br>- Nu \\"hemmagympa med Sofia\\" på TV. Sporadiska promenader, lite hantlar.<br>- Sporadisk golf med högt handicap.<br><br>- Har nog korta muskelfibrer, typ sprint, eftersom alltid haft dålig ork långlopp.<br><br>Började få problem under joggning för ca 15 år sedan. Efter åratal av läkarbesök, provtagning och utredningar kom man fram till att vartannat hjärtslag hoppades över, därav orkeslöshet. Orsak förmaksflimmer och AW-blockering ena hjärt-kammaren. Operation Pacemaker december 2019, blodförtunnande medicin samt Betablockerare.<br>Och nu 79 års ålder! <br>Låter knappast som om man ska prova en ny träningsform! Och verkligen inte i ett längre perspektiv!<br>Vid min ålder är tidsperspektivet kort,,,,,<br>Syftet är möjligen att man ska försöka hålla sig på benen så länge som möjligt.<br>Och faktiskt ska jag kunna motionera som vanligt trots ovan nämnda hälsoproblem, enligt läkarord.<br>Och nyfiken på er metod.<br>Björn<br>&nbsp;<br><strong>Hur hittade personen till TAKKEI: </strong>Björn är nära vän till Mia Takeis familj från Hudiksvall.<br>&nbsp;<br><strong>Övergripande Mål:</strong> Enligt frågorna ovan: Syftet är möjligen att man ska försöka hålla sig på benen så länge som möjligt. Och faktiskt ska jag kunna motionera som vanligt trots ovan nämnda hälsoproblem, enligt läkarord.<br> <br><strong>Tidig/sen till träningen:</strong> Kommer några minuter innan ombytt.<br> <br><strong>Långsam/medel/snabb i pass:</strong> Medel. Energinivåerna kan variera ganska mycket från vecka till vecka. Gäller att vara lyhörd här p.g.a. hans höga ålder.<br> <br><strong>Smärta/skador historiskt: <br></strong><br>- Noterade för ca 15 år sedan orkeslöshet under sin jogging. Efter flera år av&nbsp; utredning kom läkarna fram till att vartannat hjärtslag hoppades över. Orsak: förmaksflimmer och AW-blockering av ena hjärtkammaren. Operation- pacemaker december 2019.<br>&nbsp;<br><strong>Smärta/skada idag: </strong>Är utifrån ålder i bra form. Diagnostiserades dock med artros i nacken sommar 2023. Ingen direkt smärta men upplever ibland&nbsp; en strålande känsla ner i ena armen och viss stelhet. Ett finger är krökt och kan ej sträckas. Beror på något som heter vikingasjukan. När vi kör armhävningar behöver vi modifiera greppet.<br><br>Diagnostierades helt nyligen med astma. Han har hostat i flera månader. Den här hostan beror alltså inte på förkylning utan beror på astman. Troligen kommer han att få någon medicin för detta.<br>&nbsp;<br><strong>Fokus:</strong> smärtfri/smidig/stark/snabb -&nbsp; Smidigare ovan huvud. Annars att långsamt och säkert addera vikt och göra honom starkare.<br> <br><strong>Mediciner:</strong> Betablockerare och blodförtunnande.<br> <br><strong>Övrigt:</strong><br><br>* I Uppvärmningen- Jag kör serie 0 med positiv klack K2. Tycker att han kan ta ut rörligheten i överkroppen bättre då. Hoppar inte i uppvärmningen heller.<br>* Var Jurist i arbetslivet men gled över till att blev egen företagare inom industrin.<br>* Bor några stenkast från G7. &nbsp;<br>* Flera barn och barnbarn.<br>* Gillar att spela golf men kommer inte ut så oftast på golfbanan som han vill.<br>* Pratar gärna om golf och idrott som går på TV.<br><br></div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2025-01-01 13:23:07.753347	2025-01-01 13:23:07.753347	html
