1719	personal_bookings	\N	6	{"user_ids"=>["6", "12", "9", "18", "17"], "date"=>"2025-01-10", "end_date"=>"2025-01-11", "start_time_hour"=>"5", "start_time_minute"=>"00", "end_time_hour"=>"6", "end_time_minute"=>"00", "all_day"=>"true", "repeat_until"=>"", "personal_booking"=>{"name"=>"Utbildning HGB", "text"=>"", "kind"=>"Corporate"}, "participants"=>"true", "send_email"=>"yes", "message"=>"", "button"=>"", "controller"=>"personal_bookings", "action"=>"create"}	2024-12-23 11:26:10.318171	2024-12-23 11:26:10.318171	html
1720	notes	\N	2	{"authenticity_token"=>"awyMMI_8QJRESTruJ-c5k0Q4rr1FE79R5r-Bfh8753RyI5Cvugyn6CyH8He1-HUmXEyBIFsijiqaZi92jdNTWA", "target_type"=>"Client", "target_id"=>"503", "note"=>{"text"=>"<div>Skor – JA T19<br>Låda – JA T19<br>Mapp – JA T19<br>&nbsp;<br>Startår – 2013?<br>&nbsp;<br>Svaren på de fyra frågorna –&nbsp;<br>Hur ser din eventuella träningsbakgrund ut?<br>Jag har tränat mycket med PT, men nu var det en ganska god tid sedan. Gjorde som sagt ett antal år hos er med Jens Löfgren. Senaste tiden utan träning och relativt kraftig viktuppgång.<br>&nbsp;<br>Tränar du något idag? Om ja - vad och hur mycket?<br>Se ovan, dåligt nu men åker en del slalom och längd och promenerar en hel del.<br>&nbsp;<br>Har du några skador eller andra hälsoproblem vi behöver ta hänsyn till?<br>Hälsenan främst. Även lite dåliga knän. Spinal stenos.<br>&nbsp;<br>Vad vill du att träningen ska ge dig i ett längre perspektiv?<br>Att jag inte skall gå sönder vid skidåkning jakt etc. Dvs stärkande muskler runt leder och rygg för att orka längre vandringar med vikt på ryggen.<br>&nbsp;<br>Hur hittade personen till TAKKEI – ?<br>&nbsp;<br>Övergripande Mål – Starkare och smärtfri. Vill hålla för sina aktiviteter så som skidor och jakt.&nbsp;<br>&nbsp;<br>Tidig/sen till träningen – I tid&nbsp;<br>&nbsp;<br>Långsam/medel/snabb i pass – Långsam/medel<br>&nbsp;<br>Smärta/skador historiskt –<br>HÄLSENA- drog hälsenan 2021<br>RYGG- Spinal stenos.<br>KNÄN- ”dåliga knän” lite oklart vad (kan vara kopplat till övervikten)<br>ÖVERVIKT- högt blodtryck, inre bukfetma, diabetes<br><br>Smärta/skada idag - NEJ&nbsp;<br>Mail från Albert den 11/1 -24<br>\\"Som ni vet så var jag och fixade med lite prover i de nedre regionerna, och i eftermiddags så diagnostiserades jag med en lite halvaktiv prostatacancer. Det innebär operation relativt snart, och sedan en konvalescens, och ytterligare en period utan tunga lyft. Operationen är den 29/1 så jag tänkte komma in och träna 23:e och 25:e som planerat, men tiderna därefter får vi stryka just nu. Det kan ta 6 veckor innan jag är tillbaka, men också 12, så bättre att vi bokar nya när jag har lite klarhet i hur det går.\\"<br><br>Mail från Albert 28/8:<br><br>” Mia och Hanna har säkert redan informerat er, men var hos min fysioterapeut idag så lite uppdatering.<br>&nbsp;<br>Jag har tränat en hel del tidigare, inte minsk på Takkei. Förra året var hösten rätt bra och vi körde på normalt. I januari gjorde jag en canceroperation, och i påskas fick jag mykoplastisk lunginflammation, vilket påverkade mitt fysiska tillstånd menligt minst sagt. Jag är i huvudsak återställd, och rent muskulärt ok.<br>&nbsp;<br>Jag har gått ner 10-12 kg pga framförallt lunginflammationen, men är fortfarande rätt fet, jobbar på det.<br>&nbsp;<br>Det som kvarstår är en konstig andningsproblematik som läkarna inte riktigt får rätt på. Framförallt om jag får hög puls blir jag hostig och får svårt att få ut syre till kroppen. Inget som är farligt, men försvårar träningen.<br>&nbsp;<br>Målsättningen är förstås att träna bort det här, eftersom min fysioterapeut tror att det sitter mer generellt i kroppen än att det går att bota själva andningen.<br>&nbsp;<br>Han har kommit med lite tips som Hanna och Mia föredömligt förhållit sig till men upprepade och förstärkte dessa igår. De är;<br>&nbsp;<br>Hellre högre belastning och färre repetitioner<br>Fundera på om övningar kan göras sittande/liggande för att avlasta systemet från ej nödvändig press. Tex axelpress sittande istället för stående.<br>Relativt mycket vila mellan övningar<br>Var uppmärksam på var gränsen går, för mkt jobbigare för kroppen att återhämta om man kliver över<br>&nbsp;<br>Det här är hans bild och den behöver förstås inte vara rätt. Vi hittar fram till något bra tillsammans, men ville ändå ge lite bakgrund.”<br><br>Han är tillbaka , men det kvarstår en andningsproblematik, framför allt om han får hög puls. Då blir han hostig och får svårt att få ut syre&nbsp; till kroppen vilket försvårar träningen (ej farligt).<br><br>Fokus: smärtfri/smidig/stark/snabb –&nbsp; Vi har främst fokuserat på att hitta rätt balans avseende djup, viktsättning och kroppsvikt. Överrörlig. Behöver jobba på stabilitet. Har god styrka i vissa lägen men inte i fullt ROM. Hans kroppsvikt är en belastning som inte kroppen håller för i dagsläget. Mål är att bli jämnstark i hela kroppen.&nbsp;<br>Tror att han kan utveckla stor kraft men är svag i många lägen så det är riskabelt innan alla svaga länkar stärkts.&nbsp;<br><br>Mediciner- Blodtryckssänkande, Diabetes/bantningsmedicin<br>&nbsp;<br>Övrigt –&nbsp;<br>Har god återhämtning och är generellt snabb genom passen. Han säger inte ifrån när det är lite tungt eller om det är jobbigt utan man måste påminna honom om att ta det lite lugnt, Bromsa, Inte gå till fullt djup etc.<br>Började hos oss 2023 efter ett uppehåll på ungefär 10 år. Har tidigare tränat med Jens Löfgren och Marcus Andersson. Båda dessa har lastat på för tungt och Albert fått ont. (De var innan Takkei blev Takkei och de drev sina egna firmor och tränade Albert utan systematik). Han och hans fru tränade sedan på annat gym men de lyckades också paja hans rygg i tunga marklyft.&nbsp;<br>Känner sig öm i en hälsena efter att den gått av för några år sedan. Är lite vaksam på sin rygg då han har spinal stenos ( förträngning i spinalkanalen)</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-23 11:40:11.389817	2024-12-23 11:40:11.389817	html
1721	notes	\N	2	{"authenticity_token"=>"aljkkkjFV36I4Qi0YE_11jvGeRHJN8UzVLr3pF7AqzKpojEYkgYVxa7sqA9SFvFNqNkX72xjylmueg29FNWjOQ", "target_type"=>"Client", "target_id"=>"503", "note"=>{"text"=>"<div>KaO&gt;ViD/LiN<br><br>Period och pass: X. Kör en längre period på sex pass där ni försiktigt kan öka vikt och antal övningar. Det är förberett i protokollet och ni kan köra varannat pass. OBS - läs överlämningen innan denna.<br><br>Mål period: Komma tillbaka igen - anpassa efter flås/andning därav få reps.<br><br>Fokus pass: Komma tillbaka igen - anpassa efter flås/andning därav få reps.<br><br>Klient meddelad om vilken tränare: Ja<br><br>Bokningar framöver: hela hösten<br><br>Uppdaterad Grundinformation: Ja<br><br>Nuläge och övrigt: Det har gått bra de första tre passen som jag och Johan har kört. Han började hosta mot slutet av passet med Johan varpå de valde att avsluta 10 min tidigare för att inte gå över någon gräns. Vi körde två set sittande pressar förra passet (jag fäller upp ryggstödet till ett hål från max), men sedan fick det räcka.<br><br>Ställ in er på att ta det lugnt genom passet, redan från screening med pinne. Det kan behövas pauser tidigt och helst ska han inte behöva stoppa oss tränare - viktigt att vara lyhörda.&nbsp;<br><br>Jag körde S6 igen i KB&gt;UF+PR eftersom jag vet att han blivit väldigt trött passet innan. Kan möjligen ökas till S8, men inte S10 ännu.&nbsp;<br><br>Viktor - synka med Linnéa efter ert pass på torsdag.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-23 11:40:42.582057	2024-12-23 11:40:42.582057	html
1722	notes	\N	2	{"authenticity_token"=>"uJMMWg9gKmOmP-pSHHQxmffIYt9jAeN0StLJ0qhlaJKhvBDFOpDNH87xIMuOa30s77xNQn0w0g82C2faOo3cvg", "target_type"=>"Client", "target_id"=>"579", "note"=>{"text"=>"<div>Skor - Ja<br>Låda - Nej, kommer ombytt<br>Mapp - Ja<br><br>Startår - 2022<br><br>Svaren på de fyra frågorna -<br>1) Spelat tennis och åkt en del skidor, både utför och längdskidor.<br>2) Jag tränar på gym 1-2gg/v. Promenerar någon mil varje dag och gör lite uppmjukning varje morgon.<br>3) En gammal luxerad axel. Har haft problem med rusande hjärta men opererats för det och inte haft problem sedan dess.<br><br>Hur hittade personen till TAKKEI -<br><br>Övergripande Mål - Bättre balans och styrka för att motverka åldrande<br><br>Tidig/sen till träningen - precis i tid alternativt 5min sen<br><br>Långsam/medel/snabb i pass - kan variera, men ofta snabb. Kommer han i tid hinner man allt.<br><br>Smärta/skador historiskt - En luxerad axel, samt lite stök med rygg och knä.<br><br>Smärta/skada idag - Rygg och knä ibland. Känner han av det kan man ofta jobba runt det genom att dra ner på vikten eller korta av ROM.<br><br>Fokus: smärtfri/smidig/stark/snabb - Smärtfri<br><br>Mediciner - blodtryckssänkande<br><br>Övrigt - Man till Nalini som också tränar på S42. I övrigt är han pigg och glad, god rörlighet i knäböj men ibland går han inte hela vägen även om knäsmärtan inte existerar.<br>2023-09-14 15:14:00</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-23 11:43:21.77833	2024-12-23 11:43:21.77833	html
1723	notes	\N	2	{"authenticity_token"=>"M_uUMtFMUE6WMncI4HRnEqgSsQVtzn-ePxtMLrtidHwq1Iit5Ly3Mv78vZFyayunsGaemHP_TuVDwuImKYrAUA", "target_type"=>"Client", "target_id"=>"622", "note"=>{"text"=>"<div>Skor - Ja<br>Låda - Ja<br>Mapp - Ja<br><br>Startår - 2021<br><br>Svaren på de fyra frågorna -<br>1) Hur ser din eventuella träningsbakgrund ut?<br>Alex spelade fotboll till för ca fem år sedan. Han fick stipendium i USA när han var ung. Han tränade på gym till för ca två år sedan.<br><br>2) Tränar du något idag? Om ja - vad och hur mycket?<br>Golf en gång i veckan.<br><br>3) Har du några skador eller andra hälsoproblem vi behöver ta hänsyn till?<br>Höger knä. Han har inget brosk kvar där så det gör ofta ont. KB kan var problematiskt. Han har historiskt fått ont av tunga lyft. När han har spelat golf brukar knät svullna upp. (Protes skulle kunna sättas in men den håller bara i 10-15 år och då är det slutsprunget.) Fraktur i ryggen (spondylos) - förskjutning av kota. Han tror att det kommer från fotbollen då han hoppnickade hejvilt. (Det märktes ej av idag.) I mars höll han på att sälja sitt företag och jobbade då extremt mkt (inte ovanligt med 18-timmarsdagar) och fick då någon sorts blodtrycksåkomma. Han insåg att han behöver lugna ner.<br><br>4) Vad vill du att träningen ska ge dig i ett längre perspektiv?<br>Bygga upp kroppen. Bli smidigare.<br><br>Hur hittade personen till TAKKEI - Är en gammal kund som hittat tillbaka<br><br>Övergripande Mål - Smärtfri, bygga upp kroppen, smidigare<br><br>Tidig/sen till träningen - Ofta 5 minuter innan start<br><br>Långsam/medel/snabb i pass - Medel<br><br>Smärta/skador historiskt - Knä och rygg.<br><br>Smärta/skada idag - Ryggen har blivit mycket bättre. Knäet går i omgångar beroende på total belastning i veckorna men är också mycket bättre.<br><br>Fokus: smärtfri/smidig/stark/snabb - Endast knäet som sätter stopp. Är okej smidig, bra rörlighet i axellederna. Väldigt stark och kan sätta fart när det behövs men oftast så får man anpassa utefter knäet.<br><br>Mediciner - Inte något speciellt som nämnts<br><br><br>2023-09-29 15:36:00</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-23 11:44:17.129396	2024-12-23 11:44:17.129396	html
