1742	bookings	\N	12	{"authenticity_token"=>"ml8NJ34nDg92yzPsrepICaMtvLpizktJYp8YFYo6lXK_9nMa7ptH2LcXDUs0tXjA01ERg_iT7xtNlEuyDmexyA", "subject"=>"Bokningsbekräftelse Takkei", "client_id"=>"558", "mail_to"=>["viveka.classon@vinge.se", "hanna.sillen@takkei.se"], "mailtext"=>"Hej Viveka,\\n\\nHoppas julen varit fin!\\nHär kommer en sammanställning på alla dina kommande bokningar.\\nVi ses imorgon :-)\\n\\n2024-12-27 kl. 09:30 på Tegnérgatan 19\\n-Nyår-\\n2025-01-08 kl. 07:30 på Tegnérgatan 19\\n2025-01-15 kl. 07:30 på Tegnérgatan 19\\n2025-01-22 kl. 07:30 på Tegnérgatan 19\\n2025-01-29 kl. 07:30 på Tegnérgatan 19\\n2025-02-05 kl. 07:30 på Tegnérgatan 19\\n2025-02-12 kl. 07:30 på Tegnérgatan 19\\n2025-02-19 kl. 07:30 på Tegnérgatan 19\\n2025-02-26 kl. 07:30 på Tegnérgatan 19\\n2025-03-05 kl. 07:30 på Tegnérgatan 19\\n2025-03-12 kl. 07:30 på Tegnérgatan 19\\n2025-03-19 kl. 07:30 på Tegnérgatan 19\\n2025-03-26 kl. 07:30 på Tegnérgatan 19\\n2025-04-02 kl. 07:30 på Tegnérgatan 19\\n2025-04-09 kl. 07:30 på Tegnérgatan 19\\n2025-04-16 kl. 07:30 på Tegnérgatan 19\\n2025-04-23 kl. 07:30 på Tegnérgatan 19\\n2025-04-30 kl. 07:30 på Tegnérgatan 19\\n2025-05-07 kl. 07:30 på Tegnérgatan 19\\n2025-05-14 kl. 07:30 på Tegnérgatan 19\\n2025-05-21 kl. 07:30 på Tegnérgatan 19\\n2025-05-28 kl. 07:30 på Tegnérgatan 19\\n2025-06-04 kl. 07:30 på Tegnérgatan 19\\n2025-06-11 kl. 07:30 på Tegnérgatan 19\\n2025-06-18 kl. 07:30 på Tegnérgatan 19\\n2025-06-25 kl. 07:30 på Tegnérgatan 19\\n\\nDu kan boka av eller om din träningstid senast klockan 12.00 dagen innan träning genom att kontakta någon i ditt tränarteam via sms, epost eller telefon.\\n\\nHälsningar,\\nHanna\\nTakkei Trainingsystems", "button"=>"", "controller"=>"bookings", "action"=>"send_custom_booking_email"}	2024-12-26 11:31:21.059776	2024-12-26 11:31:21.059776	html
1783	notes	\N	3	{"authenticity_token"=>"MMD-qr7n-9HsJ-J7Pf5SptAaR6NWN3TKRz8Kc8z4ELdiMYdLkO4chBC3gi6Lf8hSv06l-Ul7hp4lTwEaw_-RNA", "target_type"=>"Client", "target_id"=>"918", "note"=>{"text"=>"<div>GRUNDINFO<br><br>Skor - Ja på R30 och T19<br>Låda - nej, kommer ombytt eller med ombyte själv<br>Mapp - Ja på R30 och T19<br><br>Startår - mars 2024<br><br>Svaren på de fyra frågorna -&nbsp;<br>1) Tränade mycket fotboll och ridning när jag var yngre och höll alltid igång. Sen har jag tränat på gym i omgångar och även Yoga (både på studio och på egen hand hemma). Har haft personlig tränare tidigare (3ggr/v) under fyra månader. Därefter fortsatte jag träna på egen hand. Är ganska otränad just nu, men har ett bra ’muskelminne’ när jag väl kommer igång.&nbsp;<br><br>2)&nbsp; Nej, bara alpin skidåkning under 3 veckor av vintern.&nbsp;<br><br>3)&nbsp; Inte direkt. Fick min första son 2021 och hade mycket problem med mina höfter under graviditeten som höll i sig mer än ett år efteråt. De funkar, men är stela och jag får ont om jag står i samma position för länge. Tror jag behöver bygga på musklerna runtomkring.<br><br>4)&nbsp; Att träningen blir en del av min vardag är det viktigaste. Att bli stark i kroppen så att jag orkar vandra, klättra, surfa, paddla utan att det blir för jobbigt/tråkigt. Jag vill också förbättra min hållning.&nbsp;<br><br>Hur hittade personen till TAKKEI - Hon hittade oss via hemsidan<br><br>Övergripande Mål - Att träningen blir en del av min vardag är det viktigaste. Att bli stark i kroppen så att jag orkar vandra, klättra, surfa, paddla utan att det blir för jobbigt/tråkigt. Jag vill också förbättra min hållning.&nbsp;<br><br>Tidig/sen till träningen - hon brukar komma precis i tid eller några min för sent, beror på trafik och parkering<br><br>Långsam/medel/snabb i pass - Snabb, kan hinna allt även när hon kommer lite sent, framförallt i lyftningen, lite svårare i gymnastiken.<br><br>Smärta/skador historiskt - Lite problem med höfterna under och efter graviditeten - se ovan. Kände av knäna en del i början här när vi började göra mer och mer knäböj samt tyngre, försvann dock efter ett tag så behövde antagligen bara bli van vid det.<br><br>Smärta/skada idag - inga skador idag och ingen smärta heller, men får ofta rejält med träningsvärk efter första passet i ny period<br><br>Fokus: smärtfri/smidig/stark/snabb - Hon har inte visat på ngt smärta på något vis i träningsrummet och hon är relativt rörlig. Goda vinklar, oftast även när det blir tungt som i maxstyrkan.<br><br>Mediciner - inget uttalat<br><br>Övrigt - Amanda bor längst ut på Färingsö med sin man och son (född 2021). Hon och mannen har eget bolag tillsammans inom fastigheter/finans och hon jobbar hemifrån. De har stuga i Åre. Hon bodde i London under fem år (runt 2011) och det var där hon körde med PT tre ggr per vecka under fyra månader (hemma hos sig själv). Kommer från Halmstad och familj bor kvar så åker dit ibland. Gillar att ha en aktiv livsstil<br><br></div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:34:43.476995	2024-12-27 11:34:43.476995	html
