1782	notes	\N	3	{"authenticity_token"=>"rz86X9-LRaIkCwbMi1MINxxFsj0jeBc_ahoGCp6_fQP9zkO-8YKi99ibZpk90pLDcxFQZzw05WsIag1jkbj8gA", "target_type"=>"Client", "target_id"=>"874", "note"=>{"text"=>"<div>Skor - Har beställt ska finns på L18<br>Låda - Behöver göras en på L19<br>Mapp - Ska finnas på L18<br>&nbsp;<br>Startår - 2023<br>&nbsp;<br>Svaren på de fyra frågorna -&nbsp;<br>1. Hur ser din (eventuella) träningsbakgrund ut? &nbsp;<br>Har varit ganska aktivt sedan jag var liten. Kört fotboll, basket, innebandy, fridrott, judo, karate, thaiboxning och klättring i olika perioder, utöver det har det varit en del löpträning och på senare tid styrketräning. Kollar man på den nämre tiden (3 år) så har fokuset varit på klättring, löpning (ofta sträkor på ca 6 - 7,5 km) och styrketräning. Styrketräningen började med kropsviktsövningar - knäböj, armhävning, pull-ups, benlyft och brygg (rygg)övningar - för att sedan gå över till viktträning i form av fria vikter - knäböj, militärpress (overhead press), marklyft, rod och viktade pull-ups - det höll jag på med i lite mer en 1 år för att sedan gå tillbaka till kroppsviktsövningar då jag upplevde att det översattes lite bättre i klättring, Tycker fortfarande båda formerna av styrketräning är väldigt kul och givande.&nbsp;<br><br>2. Tränar du något idag? Om ja - vad och hur mycket?&nbsp;<br>Ja, jag klättrar, springer och kör lite styrketräning. Kör (klättring -&gt; löpning -&gt; klättring -&gt; vila) och börjar om från början efter vilan. Kör knäböj, push-ups och pull-ups på klätterdagarna samt benlyft, en brygg (rygg)övning och jobbar mot handstand-push-ups på löpdagar.<br><br>3. Har du några skador eller andra hälsoproblem vi behöver ta hänsyn till?<br>Bröt högra nyckelbenet för 5 år sedan, märker inte av det något i träningen idag men tänkte att det kanske kan vara bra att ha nämnt det.&nbsp;<br><br>4. Vad vill du att träningen ska ge dig i ett längre perspektiv?<br>Jag tränar huvudsakligen för att jag tycker att det är väldigt kul och för hälso/måendeeffekterna det har. Målet nu är styrka och rörlighet/flexibilitet. Långsiktigt jobbar jag mot att vara i god form och hälsa, ha fortsatt nöje och glädje i träningen samt att kunna hålla igång/orka med ett aktivt liv.<br><br>Hur hittade personen till TAKKEI -&nbsp;<br>&nbsp;Louise Richnau är hans faster.&nbsp;<br><br>Övergripande Mål -&nbsp;<br>&nbsp;<br>Tidig/sen till träningen -&nbsp;<br>&nbsp;<br>Långsam/medel/snabb i pass -&nbsp;<br>&nbsp;<br>Smärta/skador historiskt -&nbsp;<br>&nbsp;<br>Smärta/skada idag - Inget specifikt kändes under passet.&nbsp;<br>&nbsp;<br>Fokus: smärtfri/smidig/stark/snabb -&nbsp;<br>&nbsp;<br>Mediciner - Inget utallat<br>&nbsp;<br>Övrigt -&nbsp;<br>Hans faster är Louise Richnau. Han har i princip växt upp tillsammans med den familjen, jag vet att Louise ser honom som bonusbarn.&nbsp;<br>Han verkar väldigt engagerad kring träning och tycker det är intressant</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:33:04.621312	2024-12-27 11:33:04.621312	html
1784	notes	\N	3	{"authenticity_token"=>"M40kRy_YyJKG5JAEIiAAWPTspgP5h25sFP9C-vsXf1BbwM_u9sSMDh85Ow_TUpgONXHcSVBVSFW4t2DsCTZM8Q", "target_type"=>"Client", "target_id"=>"918", "note"=>{"text"=>"<div>LiN &gt;BjT 15/10-24<br><br>Pass: Ni kommer påbörja TES. Har förberett vikter.<br><br>Info:&nbsp;<br>Jag körde ett grundstyrkepass förra&nbsp; passet då hon hade ett uppehåll på 2 veckor innan det.&nbsp; Kommer oftast 10-15 min sent men är snabb i träningsrummet och vi hinner oftast allt.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:35:08.438332	2024-12-27 11:35:08.438332	html
1785	notes	\N	3	{"authenticity_token"=>"k7jmc40LlO1raPpcaM8cQ9ecSckfL-t8stgrSWEc2BrBSZ-SowJzuJf4mgneToa3uMirkwBjGSjQqCAgbhtZmQ", "target_type"=>"Client", "target_id"=>"763", "note"=>{"text"=>"<div>Sip&gt;ThB 27/1-24<br><br>Period och pass: B2:3<br><br>Mål period: Har fokuserat på ROM hinna med infernovarven.&nbsp;<br><br>Fokus pass: Detta pass för er blir annorlunda. Hon var inne senast 9:e januari. Sen blev hon ordentligt förkyld och inte kunnat träna sedan dess. Hon skrev så här i sitt senaste sms:<br><br>\\"Hej igen! Det har varit segt med förkylningar men nu är det mest hosta för mig. Vill absolut röra mig lite nästa vecka. Lite Stretch kanske?\\"<br><br>Jag svarade att lite lugn träning kan vara lägligt.&nbsp;<br><br>Vikterna är ju inte tunga i UTH, däremot så får ni hålla nere tempot ordentligt tror jag och köra lättare i uppvärmningen. Jag har skrivit förslag på vikter. Kanske räcker med ett infernovarv? Du får stämma av läget när ni ses helt enkelt.&nbsp;<br><br>Klient meddelad om vilken tränare: Ja<br><br>Bokningar framöver: Bokad<br><br>Uppdaterad Grundinformation: Yes.&nbsp;<br><br>Nuläge och övrigt: Varit ordentligt förkyld som sagt. Så ta det lite lugnt. Lycka till och ha så trevligt!</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:39:32.541885	2024-12-27 11:39:32.541885	html
1786	notes	\N	3	{"authenticity_token"=>"_ApwtqR2HSacLzT_z_lJAi7BMFBJniLrmo21O77I8ZGUR5sffWpZugXyn_Q-i9FU71xKGuBMBNI2xZctTOnCMA", "target_type"=>"Client", "target_id"=>"763", "note"=>{"text"=>"<div>MiT&gt;KaP 7/3 24<br><br>Period och pass: Andra prep G<br><br>Mål period: Komma in i gymnastikrörelserna&nbsp;<br><br>Fokus pass: Komma in i gymnastikrörelserna&nbsp;<br><br>Klient meddelad om vilken tränare: Ja<br><br>Bokningar framöver: Hon ligger bokad några fredagar framöver (och jag tror att hon vill fortsätta tills hon kan börja på sin Barre igen - hennes tränare kan inte ta klienter nu).<br><br>Uppdaterad Grundinformation:<br><br>Nuläge och övrigt: Lite stel vänster, yttre vrist. Hon ramlade illa i våras när hon och Ulf&nbsp; var på semester vid Medelhavet. Det har läkt otroligt bra men hon känner att hon är lite stel fortfarande i vissa lägen. Bensparkar gjorde vi stående! Låt henne ta handledsskydd innan hon gör stödövningarna. Köttbullsrullningar där hon sitter som startläge - första håller om knäna och sedan raka armar för att jobba med bålen lite mer (finns på film i Valvet). Tänka tung höft i armhävningarna så att hon inte sticker ut mer rumpan för mkt. Fötterna mot viktskiva enligt bild i HDR. I vindrutetorkaren hade hon ganska raka ben. Hon är duktig och rör sig fint. Ni kommer att få en fin timme :)</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:39:56.396706	2024-12-27 11:39:56.396706	html
1787	notes	\N	3	{"authenticity_token"=>"ul96ntJ770TcfrZNZC4U6At_m6_WFkFMjks7KbJE3sforgN__HIIESDu1hjSr44cZCt59clasxjsOzBAvUNfRA", "target_type"=>"Client", "target_id"=>"631", "note"=>{"text"=>"<div>Grundinfo<br>Skor – Ja, på R30<br>Låda - Ja, på R30<br>Mapp - Ja, på R30<br>&nbsp;<br>Startår – 2020 första gången och sen två års uppehåll för att komma igång igen 2023<br>&nbsp;<br>Svaren på de fyra frågorna – Spelat fotboll och åkt cross som ung, han har försökt träna lite själv men kom hit igen just för att få den extra hjälpen med teknik och disciplin. Han har ett stillasittande arbete och vill bli stark och smidig, långsiktigt perspektiv<br>&nbsp;<br>Hur hittade personen till TAKKEI –&nbsp;<br>&nbsp;<br>Övergripande Mål – Bli stark och må bra, bättre rörlighet OH<br>&nbsp;<br>Tidig/sen till träningen – Brukar komma ganska precis<br>&nbsp;<br>Långsam/medel/snabb i pass - Medel<br>&nbsp;<br>Smärta/skador historiskt – Inga skador under sin tid här, haft känningar i axeln men beror mest på stelhet och får lätt träningsvärk i ryggen, beror gissningsvis på det stillasittande arbetet och inte van med belastning på kroppen<br>&nbsp;<br>Smärta/skada idag – inget<br>&nbsp;<br>Fokus: smärtfri/smidig/stark/snabb – Att bli mer rörlig OH, framförallt jobbigt med smalt grepp men även då bli stark i alla dessa vinklar då styrkan är mer begränsande än ROM.&nbsp;<br>&nbsp;<br>Mediciner – inget vad jag vet<br>&nbsp;<br>Övrigt – Inte aktiv just nu<br><br></div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:41:30.748997	2024-12-27 11:41:30.748997	html
1788	notes	\N	3	{"authenticity_token"=>"YFVMxoKxU6tj024CVchl5j4zLdWWetQZWgEqVkcNOqAypDUnrLi0_p9DDlfjSf8SUWfPj4k2Jk04cSE_SAq7Iw", "target_type"=>"Client", "target_id"=>"922", "note"=>{"text"=>"<div>BjT &gt; ViD<br><br>Anders vet som sagt att ni ses, skor finns och han tar med kläder (men låda + tvättpåse kan du fixa) och tanken är att dubbelperiodisera. Som sagt har jag fyllt i vad jag tror skulle vara lämpliga vikter för hela kommande period A TES. Därefter fortsätter ni med A LES för vi ligger då helt rätt i fas. Vi får stämma av då och då och kanske kolla på att vikterna ligger i synk för resp period. Mer info finns i föregående notis. Jag ska också nämna att Anders harft en liten hjärtinfarkt där ett par procent av härtat \\"dog\\" men alt har gått mycket bra och han har en väldigt fin utveckling. Mycket nöje!<br><br>BjT &gt; LiN<br><br>Anders (är bror till vår kollega Karin) har tränat hos oss tidigare och är nu tillbaka efter ett uppehåll på ca tre år. Vi har startat lugnt eftersom han gärna kör på för hårt.<br><br>Låda och mapp finns på R30 och han brukar låna skor strl JP 275.<br><br>Allt har funkat fint och vi är precis klara med prep-perioden. Ni ska således köra pass A3:1 dvs första passet i grundstyrkan. Jag har skrivit lämpliga vikter i mappen så det är bara att köra men kolla som alltid dagsformen. Hellre orka och hinna än att lycfta så tungt som möjligt.<br><br>A vet att det är ni som ses, ha det så trevligt!<br>2024-10-02</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:44:12.994528	2024-12-27 11:44:12.994528	html
