äldigt länge. Henne mamma Camilla samt sambo/man Fredrik tränar också hos oss (mormor Monica har nyligen avslutat sin tid hos oss 89 år gammal). Hon tycker om att springa (höften har dock sagt nej till det en tid) och åka skidor - gillar friluftslivet. Hon och Fredrik har två små pojkar (ca 4 och 2 år) och de bor på Söder. Hon driver företag tillsammans med sin bror Mark.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:48:34.808074	2024-12-27 11:48:34.808074	html
