1794	notes	\N	3	{"authenticity_token"=>"NYHZJd2y72mKPyvxHxFJgXRYZ-Z5FPDaAqvBdsI82YNdzDKMBK6r9RPigPruY9HXtcUdrNDG1uOu4-NgMB3qIg", "target_type"=>"Client", "target_id"=>"504", "note"=>{"text"=>"<div>7/2 2024<br>När vi sågs den 5/2 och skulle köra B1:3 berättade hon att hon har haft spänningar i nacken/nackspärr och trodde sig kunna härleda en del till de två första Bal-passen. Vi konstaterade dock att det nog är fler saker som spelar in; stress, dåligt med sömn, bärande av barn etc. Hon är stel med stång OH i (framför allt) stötfattning. Hon kommer inte helt bak/i lod utan kompenserar med handlederna. Vi ändrade om i S-kombon och fokuserade på StyV istället för ÖST, 2-1-1.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:50:28.812737	2024-12-27 11:50:28.812737	html
