1796	notes	\N	3	{"authenticity_token"=>"H_DnSxA_OsmHLWWrkxLUFbK4dZ_4TxqFeIKPwhdHRUd3vQziySN-VR7wzqBiYExDcyUP1VGdPLzUyq3U5WZ25g", "target_type"=>"Client", "target_id"=>"504", "note"=>{"text"=>"<div>8/8 2024<br>MiT&gt;HaS&nbsp;<br>&nbsp;<br>Vi påbörjade en ny gymnastiksnurra idag (U:1). Jag frågade om hon hade några fokus och det är framför allt att få iordning bålen igen (inte samma naturliga koppling som innan barnen) och att jobba på stelheterna i BR. Vi körde två RM0 med ringarna i axelhöjd. Hon klarade sig nästan upp själv men jag tror det kan vara bra att lägga in att bara hänga också/hålla upp sin egen kroppsvikt igen (verkar ha gjorts tidigare) för det var tufft/gick ej att hålla kvar slutpositionen.<br>EKB: 45 cm var lagom idag<br>BL: hon började med raka ben men där släppte ländryggen så i andra omgången fick hon köra med böjda ben istället -&gt; kändes bättre.&nbsp;<br>PR: armhävning mot stång lägsta klykan<br>ÖK-L: situps på bänk. Vi höjde från 1 hål till 2 för att hitta bålen bättre.<br>DR: i ringar. I andra omgången fick hon luta fötterna mot en viktskiva för att kunna ha rak kropp (benen böjdes innan). Jag har försökt illustrera var viktskivan är placerad i protokollet:)<br>ROT: vindrutetorkare med böjda ben<br><br>Vi avslutade med stretchövning för bröstmusklerna med hjälp av stång i ställning (hål 6 hade jag - går med lite högre), huvudet under och armarna hänger över och så får hon sänka sig ner så stretch skapas. Jag kan visa om min förklaring känns oklar :)<br><br>Hon var tio minuter sen - vi hann ej sista varvet.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:51:34.917199	2024-12-27 11:51:34.917199	html
