1798	notes	\N	3	{"authenticity_token"=>"7WGAABjyL5SKlJ5wu5K0_e3wLcMxkgiE4dnMgS-Bg8iFLGupwe5rCBNJNXtK4CyrLG1XiZhALr1Nke6X3aCwaQ", "target_type"=>"Client", "target_id"=>"504", "note"=>{"text"=>"<div>31/8 2024<br>MiT&gt;JoJ<br><br>Period: A2:3<br><br>Mål period: träna smärtfritt - bli bättre i nacken<br><br>Fokus period: noggrann i rörelserna/vinklarna och inte för tungt OH. Fortsätt att jobba med tumlås - lättare att slappna av i armar/axlar.<br><br>Övrigt: Du kan få börja passet med KB på klossar för att mjuka upp lite extra; -3, -2, mitt på, +2, +3. Eftersom vi kört klossar i början fick hon göra S0 och SKB på golvet. KB &gt;enarmspress x 2och sedan KB&gt;UTF+PR med hantlar. Jag ser nu att jag missade att fylla i antalet reps samt S, F, A (jag tränade henne på G7 och hade inte mappen - fyllt i i efterhand). Hon körde ett varv INF1, tre varv INF3 och ett varv INF3 i 2:2. Hon var okej men blir lätt öm i nacken och nu var hon även extra stressad - ville ej prata jobb. Hon kan låna kläder (M-ish) och skor 260. Enjoy:)</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 11:52:34.596301	2024-12-27 11:52:34.596301	html
