1810	notes	\N	3	{"authenticity_token"=>"CqPJKsyeEo6s3vBnnoMTaCsjlWiRocp32pMprKCnFq9i7iKDFYJWEjUDW2xv8Ys-6r7vIjhz7E522wu6UoYlDg", "target_type"=>"Client", "target_id"=>"885", "note"=>{"text"=>"<div>29/12 2023<br>KaO&gt;MiT<br><br>Period och pass: Tränat 0:2 och 0:3<br><br>Mål period: Hitta in i rörelser, bli stabilare i knäböj (upprätt och knän i samma riktning som tår). Bättre uthållighet - ta sig genom INF1 med högre hastighet. Hinna med extra armhävningar mot stång då hennes mål långsiktigt är att kunna göra armhävningar.<br><br>Fokus pass: Hållning - 3P genomgående. I knäböj - armbågarna uppe på samma nivå genom hela rörelsen. Inandning (lätt) i toppen och hålla buktryck genom rörelsen i MSU.<br><br>Nuläge och övrigt: OTROLIG utveckling! Bättre stabilitet i enbensrycken och hon lyfter nära och bra. Knäna är inte alls lika vingliga i knäböjen.&nbsp; Hennes sumomarklyft ser riktigt bra ut nu och vi kunde öka vikten där med bibehållen teknik. Lyfter allmänt med mycket mer pondus. Uthålligheten har förbättrats mycket- dock började hon klippa djupet i SKB i sista passet så inte riktigt jämförbara siffror.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 12:11:21.236467	2024-12-27 12:11:21.236467	html
