1813	notes	\N	3	{"authenticity_token"=>"JTH4r7l1Ns4sPTnykp8-yxFvM4TVsx5L3hbs0NILsxZ3wIFOl3zRm9CtWackHqQ_fjvR3sr_7B-8Zue53QwylQ", "target_type"=>"Client", "target_id"=>"619", "note"=>{"text"=>"<div>Grundinfo<br>Skor - Ja<br>Låda – Ja (inga kläder i just nu)<br>Mapp - Ja<br><br>Startår - 2020<br><br>Svaren på de fyra frågorna –<br>1. Jag har hållit på med ridning och hästar i ung ålder (ca 100 år sedan....) sen har jag gått på gym i olika omgångar och gruppträning. Jag hade en PT för ca 5 år sedan och sedan dess har jag mest gått på dans men även lite gruppträning på jobbet.<br><br>2. Jag går på dans ca 3 ggr i veckan, promenader och cyklar till och från jobbet varje dag ca 1,5 mil sammantaget. Om jag tittar på min Fitbit så säger den att jag är aktiv ca 600 min i veckan...men vet inte om det räknas som träning precis.<br><br>3. Nej inga skador men är stel och har lite ont i mina knän emellanåt men inte så farligt!<br><br>4. Styrka och spänst och en miss world kropp?!<br><br><br>Hur hittade personen till TAKKEI -<br><br>Övergripande Mål - Styrka och spänst och en miss world kropp?!<br><br>Tidig/sen till träningen -<br><br>Långsam/medel/snabb i pass -<br><br>Smärta/skador historiskt – Problem med knäna. Ryggskott.<br><br>Smärta/skada idag – När jag träffade henne 7/6 -24 efter ett uppehåll på ca 10 månader var hon smärtfri – ej ont i knäna som hon haft mkt problem med. Hon är rädd att få ont i dem igen så vi kör en väldigt lugn upptrappning.<br><br>Fokus: smärtfri/smidig/stark/snabb – Fortsatt smärtfri, bygga upp smidighet och styrka igen.<br><br>Mediciner – Inget uttalat<br><br>Övrigt – Angela hade som sagt ett uppehåll på nästa ett år pga knäna och att hon fick post-covid och var ganska dålig. Hon har tränat annat, dansar bl.a., är nu smärtfri men är rädd att få ont igen. Hon mådde bra efter första passet men hade fått lite kramp i ena vaden. Angela är 60 år, kommer ursprungligen från Skåne och jobbar på polisen. Angela önskar 17:30-tid i sommar och höst.<br>Fokus: hålla ryggen i EnbR och jobba mer ben, hitta hyllan i KBF.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 12:13:59.705033	2024-12-27 12:13:59.705033	html
