1822	notes	\N	3	{"authenticity_token"=>"V02_oZNt7qxkcNjYLMgKbARGwMc-lmJdsiBovo_pIKUFvMZAvWQJ-ZjguI2aSZCYaxIinSHakAnQUGPXgO6hJg", "target_type"=>"Client", "target_id"=>"516", "note"=>{"text"=>"<div>Grundinfo<br>Skor – Ja, på R30 och T19<br>Låda - Ja, på R30 och T19<br>Mapp - Ja, på R30 och T19<br>&nbsp;<br>Startår – 2013 tror jag<br>&nbsp;<br>Svaren på de fyra frågorna –&nbsp;<br>&nbsp;<br>Hur hittade personen till TAKKEI -&nbsp;<br>&nbsp;<br>Övergripande Mål – Smärtfri och fortsätta kunna träna hos oss<br>&nbsp;<br>Tidig/sen till träningen – Kommer oftast en liten stund innan<br>&nbsp;<br>Långsam/medel/snabb i pass - Medel<br>&nbsp;<br>Smärta/skador historiskt – Hade 2020 problem med en fot, rygg och nacke. Sen mycket problem med knän i olika omgångar. Plantar fascit i foten som märks av mer eller mindre och menisk skada i höger knä. Sommaren 2023:Mycket ont i vänster knä också numera och har läkarkontakt, ska antagligen opereras under hösten<br>&nbsp;<br>Smärta/skada idag – Knä märks fortfarande av och hälsporre, kroppen har allmänna känningar men kan träna på bra med det mesta.&nbsp;<br>&nbsp;<br>Fokus: smärtfri/smidig/stark/snabb – Smärtfri hoppas vi hon blir mer och mer nu när hon får hjälp med knät. Har god rörlighet och bra grundstyrka även om hon varit starkare förr innan skadorna började störa för mycket. Fin lyftteknik<br>&nbsp;<br>Mediciner – inget vad jag vet<br>&nbsp;<br>Övrigt – Är väldigt petig med tränarbyten, om man blir sjuk och blir vikarie är det viktigt att meddela henne det så det inte blir en överraskning.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 13:56:16.80989	2024-12-27 13:56:16.80989	html
