1862	notes	\N	3	{"authenticity_token"=>"cIez_7_lgmB34MQgfD_e0ChcjZyhe0B5_9nAZWfiRXlxegwHVsg1kZMdQa0ETHuDS3TVwM5h3lmxwYEvtweCkQ", "target_type"=>"Client", "target_id"=>"659", "note"=>{"text"=>"<div>Grundinfo<br>Skor - Ja&nbsp;<br>Låda - Nej, kommer ombytt&nbsp;<br>Mapp - Ja&nbsp;<br><br>Startår - 2018&nbsp;<br><br>Svaren på de fyra frågorna -&nbsp;<br><br>Hur hittade personen till TAKKEI - Via Eva Redhe&nbsp;<br><br>Övergripande Mål - Smärtfri rygg och slå längre i golf (&gt;250m). Att låta hjärtat vara lent, inte låta sig stressas.&nbsp;<br><br>Tidig/sen till träningen - Oftast precis på minuten.&nbsp;<br><br>Långsam/medel/snabb i pass - Medel&nbsp;<br><br>Smärta/skador historiskt - Ont i ryggen. När hon spelade mycket tennis fick hon alltid ont i ryggen efteråt.&nbsp;<br><br>Smärta/skada idag - Anna berättade 16/8 -23 att hon fick väldigt ont i ryggen i somras och träffade då en naprapat i Skåne. Hon har tre kejsarsnitt i bagaget och naprapaten sa att hon behöver aktivera musklerna runt snittet. Hon behöver träna bål då hon har kompenserat och blivit sned.&nbsp;<br><br>Fokus: smärtfri/smidig/stark/snabb - Anna kommer ner djupt i KBF men tappar in bäckenet om hon går hela vägen ner samt höger knä trillar in lite och hon tappar hälen. Hon är lite skev även ök och tappar lättare fixeringen med höger arm -&gt; rullar axel i RKB. Hon är starkare än vad hon tror – mkt sitter i huvudet. Blandad kompott, ibland bra fart och ibland mkt armar. ÖST brukar gå riktigt fint.&nbsp;<br><br>Mediciner - Tror inte det&nbsp;<br><br>Övrigt - Anna älskar R-kombon från A-GRU och får alltid göra den ett varv i samtliga pass. Hon spelar en golf och tennis - nu för kul, som ung mer seriöst. Hon har tre barn, (Lou, Leah och Tom) och är tillsammans med Johan (ej pappan). Hon bor på Gärdet, men är relativt ofta i Skärgården eller i Skåne (ledigheter).&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-28 19:45:22.971062	2024-12-28 19:45:22.971062	html
1833	notes	\N	3	{"authenticity_token"=>"RPs_HVVwb8POjd2VCMKRu4nEz82Ykp9DzPT1RsUwCIoWCkb8e3mIljIdvcC-QwtP5pAtl4febReuhP4vyjeJCQ", "target_type"=>"Client", "target_id"=>"1057", "note"=>{"text"=>"<div>Grundinfo<br>Skor - Ja<br>Låda - ja<br>Mapp - Ja<br><br>Startår - 2024<br><br>Svaren på de fyra frågorna -<br>1. Hur ser din eventuella träningsbakgrund ut?<br>Tränat ca 1-3 ggr i veckan och i snitt kanske 1,5 ggr / vecka men har kommit av mig under hösten. Senaste två åren har jag tränat crossfit, yoga, löpning. Cyklar dagligen när det inte är vinter.&nbsp;<br><br></div><div>2. Tränar du något idag? Om ja - vad och hur mycket?<br>&nbsp;Precis försökt komma igång med yoga och löpning senaste veckan.<br><br></div><div>3. Har du några skador eller hälsoproblem som vi behöver ta hänsyn till?<br>Fortfarande känningar av stukad fot (stukade i slutet av sept).&nbsp;<br>Ländryggen gör ont till och från och kräver underhåll.<br>Knän är känsliga pga gammal löparskada.<br><br></div><div>Höger axel gör ont i vissa styrkeövningar, paddla.&nbsp;<br>Gravid.<br><br></div><div>4. Vad vill du att träningen ska ge dig i ett längre perspektiv?<br>&nbsp;Förbera kroppen på graviditet och bära och lyfta barn. Förebygga skador. Få tillbaka träningspeppen så att jag bibehåller träningen.<br><br></div><div><br>Hur hittade personen till TAKKEI - Genom vän Andrea som tränar på T19<br><br>Övergripande Mål -&nbsp; Stärka kroppen under graviditet och förbereda för att bära och lyfta barn. Förebygga skador.<br><br>Tidig/sen till träningen -<br><br>Långsam/medel/snabb i pass -<br><br>Smärta/skador historiskt -<br>&nbsp;stukad fot (stukade i slutet av sept).&nbsp;<br>Ländryggen gör ont till och från och kräver underhåll.<br>Knän är känsliga pga gammal löparskada.</div><div>Höger axel gör ont i vissa styrkeövningar, paddla.&nbsp;</div><div><br><br>Smärta/skada idag -<br>Foten är fortfarande påverkad sedan stukning<br><br>Fokus: smärtfri/smidig/stark/snabb -<br><br>Mediciner -<br><br>Övrigt -<br><br></div><div><br><br></div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-27 14:06:48.60996	2024-12-27 14:06:48.60996	html
