1866	notes	\N	3	{"authenticity_token"=>"6JOkBbugNOjSoQuxAsthzcOWf1wcINSGnnzVA2V18j_pbhv9Uo2DGTZcjjx6uMSeoL4nAHM6SqbQZJRJtZA11w", "target_type"=>"Client", "target_id"=>"665", "note"=>{"text"=>"<div>Grundinfo<br>Skor - Ja<br>Låda -&nbsp; Ja (inget i lådan)<br>Mapp -&nbsp; Ja<br>&nbsp;<br>Startår - vet inte men tidigaste anteckningen är från 2018<br>&nbsp;<br>Svaren på de fyra frågorna -&nbsp;<br>&nbsp;<br>Hur hittade personen till TAKKEI -&nbsp;<br>&nbsp;<br>Övergripande Mål - Inget uttalat. Men hon tränar nästan inget utöver träningen hos oss, förutom promenader med hundarna. Så jag skulle tro att målet är kontinuitet i träningen vilket hon är duktig på att hålla!<br>&nbsp;<br>Tidig/sen till träningen - precis i tid eller 5 min sen<br>&nbsp;<br>Långsam/medel/snabb i pass - snabb<br>&nbsp;<br>Smärta/skador historiskt - Kan inte se något bakåt. Men vet att precis när vi började träna ihop hade hon lite knäkänningar genom 1-2perioder. Detta försvann och har inte gett sig till känna igen.<br>&nbsp;<br>Smärta/skada idag - Nej<br>&nbsp;<br>Fokus: smärtfri/smidig/stark/snabb - Stark(are), snabb<br>&nbsp;<br>Mediciner - Inget uttalat<br>&nbsp;<br>Övrigt - As sambo tränar också han på Takkei (L18). Hon rör sig fint men tjuvdrar gärna i OLT vilket gör att synken kan bli så där ibland. Hon har ju några år på nacke här hos oss vilket syns i hur hon rör sig, hon är bra skolad.&nbsp;<br><br>Hon jobbar med affärsjuridik och har två hundar, Nelson och Enzo.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-28 19:54:01.37484	2024-12-28 19:54:01.37484	html
1867	notes	\N	3	{"authenticity_token"=>"upumII0mm1DiFhCTXFEvlfsAgYrsM6EH7VQAa5imj6M98FHbiW6OWR6gmq1YweDID2fQHaYflQR1jp6QO88HQQ", "target_type"=>"Client", "target_id"=>"665", "note"=>{"text"=>"<div>12 feb 2024<br>ThB&gt;SoS<br><br>Period och pass: Föreslår omstart med A-BAL.<br><br>Mål period: Komma igång igen med bra kontinuitet.&nbsp;<br><br>Fokus pass: Varit borta en längre period igen. Föreslår att ni börjar om med A-BAL med grundfokuset för BAL<br><br>Klient meddelad om vilken tränare: Ja<br><br>Bokningar framöver: Är bokad<br><br>Uppdaterad Grundinformation: Ja<br><br>Nuläge och övrigt: Var borta en månad från slutet av oktober till slutet av november. Körde efter det anpassat under december för att komma igång och för att det fanns känning i en axel. Vi hann köra ett pass (A5:2) innan julhelgerna och efter det har det varit avbokningar (jobb och sjukdom). Anna har meddelat att viljan/ambitionen finns att köra igång igen nu under februari.&nbsp;<br>Jag har därför inte tränat Anna så många pass så läs grundinfo och övriga överlämningar. Mitt förslag är att starta om med A-BAL och ta hänsyn till att A inte tränat med oss sedan 21:a december (8 veckor). Du får intervjua henne om läget när ni ses.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-28 19:55:53.745525	2024-12-28 19:55:53.745525	html
