1869	notes	\N	3	{"authenticity_token"=>"0Nj5s4QDlKK4PE83j9MmKuYBPbwuO4A-Sq_0a4yKPqRXsw5IgEuBq0SKxQmLQ-l3EmZsK2QXtD3SdWqQL-O2Rg", "target_type"=>"Client", "target_id"=>"674", "note"=>{"text"=>"<div><br>15/10 2024<br>KaO&gt;MiT<br><br>Period och pass: GYMN M:2<br><br>Mål period: Orka ta i hela vägen, inte ta några genvägar<br><br>Fokus pass: Krumma/gymnastisk perfektion<br><br>Övrigt: Anna har haft en hel del resor och andra jobbaktiviteter som hållit nere träningen till en gång i veckan senaste veckorna, och då har lyftningen fått bli prio. Är därför några veckor sedan hon körde gymnastik.<br><br>Akrobatik: Hon fick dra sig/hoppa upp till pull-up-position i ringarna och försöka bromsa ned.<br><br>KB: Enbensknäböj - sikta på 40cm<br>PR: Om jag minns (eller tolkar mina anteckningar...) rätt så körde vi armhävningar mot bänk som stod uppe på podiet.<br><br>ÖK-L: Tror att hon körde med armarna fram (kolla hur jobbigt det ser ut att nudda knän i uppvärmning). 5 blir lite för lätt, men med en svårare progression orkar hon inte, så sikta på 10-8-6 (tror inte vi hann allt i GRU heller så det blir ett bra komplement)<br><br>UK-L: Progressionen var något som Måns föreslog, men jag tror att omvända upprullningar ett hål räcker gott och väl för att det ska vara riktigt jobbigt<br><br>DR: Min kryptiska anteckning tror jag betyder att hon får sätta fötterna mot bänkens fot, och att den stod nedanför podiet i höjd med sista s:et på texten uppe på flaket (ringar i höfthöjd)<br><br><br>ROT: Hjulet i ringar är rätt tuff för henne men känns nyttig. Krumma och försök hålla spänning.<br><br>Övrigt: Försök få henne att göra längorna hela vägen :)</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-28 20:00:25.66263	2024-12-28 20:00:25.66263	html
