ka två gångjärn -&gt; fina lyft!<br>Övrigt: Hon såg lite skev ut i KBB - drar till höger med höften på vägen upp. Stötsatsningen, se om stången kan ligga på plats så att den inte trillar fram. Dessa två saker tog jag ej upp med Anna.<br>2024-01-18 12:22:00</div><div><br>JJ-&gt;MiT<br><br>Period och pass: 5:3<br><br>Mål period: Verkligen ta it och försöka jobba explosivt (mer ben och mindre armar i Oly)<br><br>Fokus pass: Detta blir andra passet efter vi körde en gru pga semesteruppehåll (hon har ändå varit väldigt aktiv i skidbacken) men så fokus blir att hitta tillbaks till vikterna. Dem är generellt sätt ganska lågt satta då det var en del sjukdomar innan start av tes så det bör inte vara ett problem att köra passet.<br><br>Klient meddelad om vilken tränare: Ja<br><br>Bokningar framöver: Vt klar<br><br>Uppdaterad Grundinformation: Ja<br><br>Nuläge och övrigt: Kroppen mådde bra senast vi träffades och gru gick utan problem. Obs hon var lite tveksam att köra ett paket till pga senaste prishöjningar men har nu signat ett år till. Hon är dock väldigt motiverad och gillar träningen.<br><br>2024-01-17 16:36:00</div><div><br><br>KaO&gt;JoJ<br>Tränat pass B4:2<br><br>Fokus: Jag fortsatte Sofies fokus på ROM i RKB och KBB. Hitta ett bra sätt att veckla ihop kroppen på väg ned i MRY (fälla först, böja sedan), och trycka på med benen (\\"fötterna genom golvet\\") på väg upp.<br><br>Övrigt: Jag upplevde henne också osäker i MRY och de blev lite olika så jag ville inte gå högre viktmässigt. Hon hittade dock mer av en jämnhet och kunde hitta följden i höftfällning och knäböj bättre i sista set. Hon insåg att när hon i början klippte djupet i RKB, så berodde det på huvudet snarare än att kroppen inte klarade av mer djup. Hon hade fint djup sedan. Hon tycker som sagt att det är kul och givande med rotation så bra om hon roteras ut ibland. I övrigt mycket nöjd!<br>2023-11-24 14:01:00</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-28 20:05:23.441202	2024-12-28 20:05:23.441202	html
