1911	notes	\N	10	{"authenticity_token"=>"HFuHSKLHP5A8caRzCIHjbQ5nj3wBDYE0JGN_7O7mWTL985Arv-5qC8e6zKl9J7sHFZjwkuxdIz7sOByj5OnhbQ", "target_type"=>"Client", "target_id"=>"644", "note"=>{"text"=>"<div>Skor - Ja<br>Låda - Ja<br>Mapp - Ja<br><br>Startår - feb 2020<br><br>Hur hittade personen till TAKKEI - Lena är Hannas mamma<br><br>Övergripande Mål - En rygg som blir smärtfri med muskler som stabiliserar ryggraden (start). Ej få ont, grundstyrka, balans, hållning (2023)<br><br>Smärta/skador historiskt - Lena har artros i båda knäna - symptom som kommer i skov. Hon har artros i vänster hand (har inte märkts när vi har kört). Hon har tre utbuktande diskar i ländryggen med lite skolios samt artros där. Hon stelopererades hösten 2019 där det var som värst, dvs mellan de två kotor som omsluter den mittersta disken. Smärtan kommer från ländryggen och går via vänster höftkam ner mot ljumsken. Bröt vänster fot, gips 6 veckor, samt fick ett brott på mellanhandsbenet (förlängning av långfingret), gips i 3 veckor - i augusti –23 pga. fall i trappa.<br><br>Smärta/skada idag – Ont i ryggen till och från. Knän som känns av. Höger höft - fick en kortisonspruta början av sep-24. De sista passen 2024 mådde hon bra!<br><br>Mediciner - Arcoxia (åtmintone tidigare - smärtstillande)<br><br>Övrigt - Mamma till Hanna Sillén som sagt. Född -48. Gift med Gunnar, har hunden Molly och bor i Farsta och emellanåt i Slite där de har hus. Konstnärlig - målar, stickar, skriver och började under 2024 att spela cello.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 12:26:54.208891	2024-12-30 12:26:54.208891	html
