1973	notes	\N	3	{"authenticity_token"=>"wR6xoT5c0bzeFyj_COdjWNp-cCGHeCHRQ44-Wb_f6TjzmB8MG63f86wO7ttsyNEwLqIGVTCDpV0pm-wv4_HmKA", "target_type"=>"Client", "target_id"=>"788", "note"=>{"text"=>"<div><br>MiT&gt;BjT<br><br>Period och pass: A3:2 (i C-protokoll)<br><br>Mål period: R.O.M.<br><br>Fokus pass: Ta ut rörelseomfånget i rörelserna och inte stressa igenom. Hon kan börja prata mitt i övningarna vilket gör det lite svårare med fokus.<br><br>Klient meddelad om vilken tränare: Ja<br><br>Bokningar framöver: Fredagar 13:30 men hon är borta vid några tillfällen - då är det väldigt svårt att hitta ersättningstid pga jobb/barnvakt.<br><br>Uppdaterad Grundinformation: Neda uppdaterar<br><br>Nuläge och övrigt: Anna är obehindrat efter sjukdom och operation men ev kommer det behövas en ny (pga. att den inte blev så bra - estetiskt) men då ska inte läkprocessen blir så lång. Anna har fått köra S0 och SKB på klack två. För att fokusera på djup i KB&gt;UTF så skippar vi PR och senast adderade jag skumblocken så att hon skulle komma ner i djup i knäböjen även i den övningen. Jag har använt klack i R-kombon och sedan skumblocken igen i KBF. Hon kan komma ner till 25cm (vi körde på 30 i 3:2) men hennes högra knä, framför allt, trillar gärna in och hon faller fram en del så man få hålla en låg vikt - det är tufft. Jag använde 10cm skumblock i UKB så att hon nuddar det bakre knät där i första passet men in det andra hade hon ont i ena tån då hon slagit den i en pool när de var på semester så då blev det bul sq istället. I MRU kan man få påminna henne om att lugna ner så att hon inte faller fram för fort. Njut :)<br>2024-03-22 07:42:00</div><div><br>MiT&gt;BjT<br><br>Period och pass: A3:3 (i C-protokoll)<br><br>Mål period: R.O.M.<br><br>Fokus pass: Ta ut rörelseomfånget i rörelserna och inte stressa igenom. Hon kan börja prata mitt i övningarna vilket gör det lite svårare med fokus.<br><br>Klient meddelad om vilken tränare: Ja<br><br>Bokningar framöver: Fredagar 13:30 men hon är borta vid några tillfällen - då är det väldigt svårt att hitta ersättningstid pga jobb/barnvakt.<br><br>Uppdaterad Grundinformation: Neda uppdaterar<br><br>Nuläge och övrigt: Anna är obehindrat efter sjukdom och operation men ev kommer det behövas en ny (pga. att den inte blev så bra - estetiskt) men då ska inte läkprocessen blir så lång. Anna har fått köra S0 och SKB på klack två. För att fokusera på djup i KB&gt;UTF så skippar vi PR och senast adderade jag skumblocken så att hon skulle komma ner i djup i knäböjen även i den övningen. Jag har använt klack i R-kombon och sedan skumblocken igen i KBF. Hon kan komma ner till 25cm (vi körde på 30 i 3:2) men hennes högra knä, framför allt, trillar gärna in och hon faller fram en del så man få hålla en låg vikt - det är tufft. Jag använde 10cm skumblock i UKB så att hon nuddar det bakre knät där i första passet men in det andra hade hon ont i ena tån då hon slagit den i en pool när de var på semester så då blev det bul sq istället. I MRU kan man få påminna henne om att lugna ner så att hon inte faller fram för fort. Njut :)<br>2024-03-22 07:42:00</div><div><br></div><div><br>MiT&gt;JoJ<br><br>Period och pass: A3:2 (fast i C-protokoll)<br><br>Mål period: R.O.M.<br><br>Fokus pass: Djup i alla knäböj och utfall<br><br>Klient meddelad om vilken tränare: Ja hon vet om att hon ska träffa dig<br><br>Bokningar framöver: Hon ligger i grund bokad fredagar 13:30 men några veckor är ändrade och hon är även bortrest några veckor.<br><br>Uppdaterad Grundinformation: Ja<br><br>Nuläge och övrigt: Anna har nu inga begränsningar i kroppen efter sjukdom och operation. Hon har inte varit inne på tre veckor pga. kurs och att det inte har gått att hitta alternativa tider. Passet börjas med tio KB med negativ klack, screening och sedan S0 och SKB på klack två. För att fokusera på djup i KB&gt;UTF så skippar vi PR. Jobba med K2 i R-kombon. Använd gärna skumblocken i KBF. Hon kan komma ner till 25cm. Hennes högra knä, framför allt, trillar gärna in och hon faller fram en del så håll vikten låg - det är tufft för henne med djupet. Använd 10cm skumblock i UKB så att hon nuddar det bakre knät där. Enjoy:)</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 14:25:52.793486	2024-12-30 14:25:52.793486	html
1974	notes	\N	3	{"authenticity_token"=>"SAEmKOibvoLVFcOeyCi0fU5SHdnJW3zOdLLPbYiY8nEbgARSoTot6tzNsOgsyqVCexSO7rhH3ivn9jjBkdXc8A", "target_type"=>"Client", "target_id"=>"790", "note"=>{"text"=>"<div>Grundinfo<br>Skor - Ja L18<br>Låda - Ja L18<br>Mapp - Ja L18<br>&nbsp;<br>Startår - 2021<br>&nbsp;<br>Svaren på de fyra frågorna -&nbsp;<br>&nbsp;<br>Hur hittade personen till TAKKEI - Anna arbetar som osteopat mitt emot S42 och Karin O fick tips om henne i samma veva som vi skrivit på för S42-lokalen. Fler och fler tränare från Takkei har sedan börjat, och successivt även väldigt många klienter. Anna har alltid gillat det vi gör och vi bjöd in henne för en provträning som Simon genomförde för att hon skulle förstå ännu bättre hur vi jobbar. När hon kände sig redo rent fysiskt (se historia) började hon träna som klient.<br>&nbsp;<br>Övergripande Mål - Rörligare och starkare för att må bra och hålla för sitt jobb.<br>&nbsp;<br>Tidig/sen till träningen - i tid<br>&nbsp;<br>Långsam/medel/snabb i pass - Medel/långsam<br>&nbsp;<br>Smärta/skador historiskt - 90-tal: skadat nacken i två bilolyckor<br>- 2007 - livmoderhalscancer, fick operera bort livmoder+äggstockar. Är lite försiktig med buktryck även om hon kan hålla ett lättare tryck - men andas gärna genom rörelserna<br>- Har varit utbränd och har haft en del problem med binjurarna-&gt;kortisonbehandling och dålig ork. När hon först provade på träningen hos oss kände hon att hon inte kunde utsätta sin kropp för så mycket belastning/stress, men nu fungerar det iaf väldigt bra.<br>- Har haft condromalasia i knäna som ung men brukar inte ha ont i knän idag<br>- Har ofta haft problem med höger axel (senast höst-22)som är lite framåtroterad, samt höfterna där höger höft är inåtroterad och vänster är utåtroterad<br>- Har sträckt höger hamstring för längesedan och kan ibland känna av den.<br>- Tennisarmbåge vår -23<br>- Bröt lilltån sommar -23<br>&nbsp;<br>Smärta/skada idag - Bara stelheter, ingen smärta. Kan känna av höger hamstring ibland men inte smärtsamt.<br>&nbsp;<br>Fokus: smärtfri/smidig/stark/snabb - Smidig<br>&nbsp;<br>Mediciner - Kortison<br>&nbsp;<br>Övrigt - Som osteopat har Anna väldigt bra koll på kroppen och känner in och förstår mycket i rörelserna. Hon har dock fullt förtroende för oss när det gäller träning och vad som behövs i träningsväg, så man behöver aldrig känna sig ifrågasatt. Anna är stel, främst i bröstrygg, höfter/säte, fotleder. I knäböj har hon en tendens att bara böja knäna och inte höfterna, så hon kan behöva påminnas om att få en rörelse i höften också för att komma djupare.<br><br>Hon vill verkligen bli rörligare och jobbar just nu (okt -23) på att få upp rörligheten i fotleder själv utöver det vi gör på Takkei. Hon brukar också göra lite knäböj och kettlebellsvingar på jobbet mellan klienter, och går på lugn yoga. Anna tränar hos oss&nbsp; varannan vecka.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 14:27:30.172744	2024-12-30 14:27:30.172744	html
