1977	notes	\N	3	{"authenticity_token"=>"eoqZLt9nTo0hZttly-QaNR0ayP8wfsBXrCtmwTVQM_BIDDeD-pZAwlN_HUGvy6hd6ca-i4eFRNvGPrS3aX484A", "target_type"=>"Client", "target_id"=>"790", "note"=>{"text"=>"<div>KaO&gt;ThB<br><br>Period och pass: Du kör ett till MAX och påbörjar sedan TES<br><br>Mål period: ROM + lite mer utmanande vikter<br><br>Fokus pass: Upprätt men djupt&nbsp; i knäböj med hantel<br><br>Klient meddelad om vilken tränare: Ja<br><br>Bokningar framöver: Ja, Anna kör normalt sett varannan vecka men blir lite annorlunda under sommaren så kommer köra två pass med dig.<br><br>Uppdaterad Grundinformation: Ja<br><br>Nuläge och övrigt: Anna opererades för gråstarr för några veckor sedan och behövde avboka ett pass däromkring för att det inte kändes ok att anstränga sig. Vi körde sedan ett lättare MAX veckan efter det. Blir därför ett extra MAX nu som du får lägga till i X-protokoll. Veckan därpå kan du starta TES. Utgå från förra TES.&nbsp;<br><br>Anna är egentligen ganska stark, men iom bortopererad livmoder får hon ta det lite lugnare med vikter. Vi jobbar mycket på rörlighet och hon kör knäböj med hantel upprätt framför bröstet (goblet squats) för att komma djupare. Jag har kört ett rörlighetspass som praktiktimme med henne och kommer köra några sådana till. Hon skulle må bra av att bli rörligare i ffa bröstrygg, höfter och fotleder.<br><br>10/7-24</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 14:28:46.723118	2024-12-30 14:28:46.723118	html
