1988	notes	\N	10	{"authenticity_token"=>"UHcmsapKQ0gEVt44wIGV1EjsqF8AKUdHlP3xlc_Wc3Gx3zHSt2MW0_-dtuK1J82-UxPXse155U1cppLaxdnLLg", "target_type"=>"Client", "target_id"=>"797", "note"=>{"text"=>"<div>Skor - Ja på T19<br>Låda - Ja på T19<br>Mapp - Ja på T19<br><br>Startår - 2017 (feb). Paus apr 2019 - aug 2021.<br><br>Övergripande Mål - Smärtfri axel/skuldra. Målsättningen är smidighet + grundstyrka samt grundträning för långdistans.<br><br>Smärta/skador historiskt - Knän, vänster axel/skuldra, rygg (har bla dragit till den i en StyR hos ossi dec -22).&nbsp;<br><br>Smärta/skada idag - Halux valgus höger fot. Han kan känna sig stel i början av passen (rygg, ljumskar, vänstra sidan). Han har träffat Anna B (sedan mars -24) och det har hjälpt. För att mjuka upp ljumskar kör vi alltid bensparkar från gymnastiken i början av passen (efter uppvärmningen med pinne).<br><br>Övrigt - Daniel bör köra omvända lyft från golv så att han banar in rörelsen och får till ryggen rätt. Han är vänsterhänt. Han har tidigare spelat fotboll och gillar att åka skidor (varit skidtränare). Gift/sambo, tre döttrar, spelar golf och springer lite. De har sommarhus i Kristinehamn i Värmland. Född 1974.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 15:07:40.609152	2024-12-30 15:07:40.609152	html
1989	notes	\N	10	{"authenticity_token"=>"fxKu05p2b4A4ebaUkWCvVypLPSYwTWBzOZaxXhBAH1Weurmwh186G8Oy3k7kxvc9MbRCyN0dwnnxzdIRGk-nCg", "target_type"=>"Client", "target_id"=>"877", "note"=>{"text"=>"<div>Skor - Ja på T19<br>Låda - Ja på T19<br>Mapp - Ja på T19<br><br>Startår - 2023<br><br>Svaren på de fyra frågorna -<br>1) Fram till för några år sedan så skulle jag säga att jag rört på mig mycket jämfört med snittet. I amerikansk grundskola hade vi gympa varje dag. Har sedan sprungit mycket - i många många år sprang jag säkert 6 dagar i veckan (men inte så långt), i säkert 10-15 år har jag kört ett enklare pass några ggr i veckan på vårt privata gym i BRF (crosstrainer, gång i uppförsbacke, kortare löptur, lite lätta vikter, gummiband, stretch, hopp m.m.), i 6-7 spelade jag tennis några ggr i veckan. Några år till och från haft PT 1-2 ggr i veckan. Promenerar en hel del. Träningen har alltid varit mer åt konditionshållet, inte minst eftersom jag haft ont av olika slag - mycket nackproblem efter tennisen, tennisarmbåge, ledvärk osv. Tror även att jag alltid föredragit kondition inte minst eftersom jag haft lättare för det än styrka. Nu är jag 54 år och de senaste 4-5 åren har jag lagt mycket av mitt eget liv åt sidan för att istället ta hand om mina föräldrar. Jag har gått ner i deltid jobbmässigt, jag lägger sedan 30 timmar minst i veckan på att vara med min pappa (demensboende) och även stötta min mamma. Promenaden t/r (alla dagar orkar jag inte gå, bär på mat och tunga saker) från Norr Mälarstrand till Östermalm (35 minuter i varje riktning i snabb takt) gör liksom att min ork till att träna inte riktigt finns där som förr. Fötterna och benen har blivit trötta av promenaden och alla ärenden på vägen, så att springa 3-4 dagar i veckan blir för mycket. Jag behöver ta ett omtag på min träning helt enkelt och få hjälp att stärka kroppen på ett nytt sätt med utgångsprunkt i att jag ändå får så mycket vardagsmotion genom att ta mig fram och tillbaka till pappa.<br><br>2) Springer 3-5 km en till två ggr i veckan. Det går inte fort dock. Kör eget litet träningsprogram hemma. Går fortsatt mycket i snabbt tempo.<br><br>3) Ledvärk i ffa händer/fingrar. Nacken känns svag. Träffar reumatolog i nästa vecka för att se om nackvärken hänger ihop med ledvärken i händerna.<br><br>4)<br>HÄLSA framför allt, ett bra och starkt åldrande utifrån mina förutsättningar. Hjälp att jobba med de bitar i kroppen som jag eftersatt, eftersom man gärna gör det som känns lättast och därmed roligast... Sen vill jag såklart att det gärna får synas lite. Tona armarna vore trevligt liksom att förhindra att rumpan blir allt plattare och tråkigare. Men armar och toning handlar ju mer om att isf tappa i vikt. Vill även förhindra att hållningen slappar till sig. Ser tendens till sk gamnacke och det vill jag absolut råda bot på.<br><br>Hur hittade personen till TAKKEI - Via Maria Edsman<br><br>Smärta/skador historiskt - Ledvärk i ffa händer/fingrar. Nacken.<br><br>Smärta/skada idag - Anna började under våren -24 få ont i ena armbågen. Hon kunde knappt belasta den och marklyft som brukar fungera gjorde ont. Den är nu mkt bättre men man behöver fortsatt vara försiktig med pressar och övningar OH. Nacken blev mycket bättre under våren men har känts igen efter sommaren (-24) - bra att ha den under radarn.<br><br>Fokus: smärtfri/smidig/stark/snabb -Bli smärtfri. (Hon kände att hon tappat mkt styrka efter långt uppehåll under sommaren.)<br><br><br>Hospitality: Anna önska omklädningsrum 3 på T19 - hon gillar det rummet väldigt mkt men var inte så förtjust i rum nr 4. Anna brukar ta en kaffe när hon kommer hit innan passet.<br><br>Övrigt - Anna är aktiv och har alltid fullt upp. Hon är gift med Håkan, och har en dotter (Nicki) som pluggar på Harvard. Anna pluggade med Maria E på Handels (det är så de känner varandra). Se ovan om livspussel.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 15:12:04.621	2024-12-30 15:12:04.621	html
1990	notes	\N	10	{"authenticity_token"=>"erhWqTlU-q6FuZ57mS-6ZDKWfowZ8kx2lpFf5ztskjubEEHKJH2vNX5y9qHsieIOKWkBYvSi7nxeyjyoMWMqZA", "target_type"=>"Client", "target_id"=>"894", "note"=>{"text"=>"<div>Skor - Ja på T19<br>Låda - Ja på T19<br>Mapp - Ja på T19<br><br>Startår - jan 2024<br><br>Svaren på de fyra frågorna -<br>1) Är idag 51 men har tränat, i stort sett enbart konditionsträning, sedan barnsben. Fotboll, längdskidor, löpning<br>2) Ja. Cykling eller längd 1 ggr vecka. PWs varje vardagsmorgon. Styrketräning hemma 1 ggr/vecka<br>3) Haft ryggproblem de sista dryga två åren och kan inte längre springa, vilket är en sorg. Fått lättare ländryggsövningar men behöver träna mer styrka.<br>4) Bli stark så att jag kan träna och verka som tidigare.<br><br>Hur hittade personen till TAKKEI - Tips via någon som inte tränar här.<br><br>Övergripande Mål - Bli stark så att jag kan träna och verka som tidigare. Hon skulle vilja kunna springa igen.<br><br>Smärta/skador historiskt - Hon har haft ryggproblem de senaste två åren.<br><br>Smärta/skada idag - Smärtfri.<br><br>Övrigt - Sofia veckopendlar från Örebro - har en liten lägenhet nära T19. Lägenhet i Spanien. Hon gillar konditionsträning. Gift och två döttrar.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 15:21:25.475269	2024-12-30 15:21:25.475269	html
1991	notes	\N	10	{"authenticity_token"=>"HX_HXzWwQnHFoEAGaNxb5YjtP5F0tkH5BTAU6sszNQH819A8KJkX6j5rKNwdegOPkxJAf5nm4_PNa3elwTyNXg", "target_type"=>"Client", "target_id"=>"742", "note"=>{"text"=>"<div>Skor - Ja på T19<br>Låda - Ja på T19<br>Mapp - Ja på T19<br><br>Startår - 2012<br><br>Övergripande Mål - Träna för att inte ha ont i vardagen.<br><br>Tidig/sen till träningen - Tidig, är redo att starta oftast lite före utsatt tid till och med.<br><br>Smärta/skador historiskt - Diskbuktining 2015. Glaskroppsavlossning i ena ögat. Ramlade och slog i höger knä 2018. Strul med höger axel 2020. Osteoporos/benskörhet.<br><br>Smärta/skada idag - Ryggen, axel och knä kan kännas av vissa pass. Brukar oftast räcka med mindre anpassningar av de träningspassen.<br><br>Övrigt: Har en dotter, Stella. Jobbar på Vinge. Bor i Alvik/Bromma.&nbsp;</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 15:23:38.279969	2024-12-30 15:23:38.279969	html
1992	notes	\N	10	{"authenticity_token"=>"CXspTFQJuXSA5GA3lax0-Xu1BCvLjJC8eToAj0QnIVLo0z4vSSDs73svCO3gCiyTYEp7xSbcMraxYWPATiiZDQ", "target_type"=>"Client", "target_id"=>"637", "note"=>{"text"=>"<div>Skor - Ja men hon brukar ta med sig dem hem mellan passen<br>Låda - Ja på G7<br>Mapp - Ja på G7<br><br>Startår - 2020<br><br>Svaren på de fyra frågorna -<br>1) Lite av en testare av många olika saker, stavgång, gruppträning, vandring, motionssimning, motionscykling, Osteo Strong för att stärka min benstomme mm Försöker hålla mig igång med ca 2 aktiviteter per vecka men det blir mest av typen vardagsmotion.<br>2) Simmar, går stavgång - anpassat efter Corona dock så mest utepromenader mm<br>3) Nej<br>4) Bättre muskelstyrka, grund för att hålla mig frisk (fyllde 60 (2020) i våras och är mån om min goda hälsa) samt minimera risk för att få ryggont eller liknande framöver.<br><br>Hur hittade personen till TAKKEI - Via sin svärson Elisas (som fö känner Emelie).<br><br>Övergripande Mål - Bättre muskelstyrka, grund för att hålla sig frisk, samt minimera risk för att få ryggont eller liknande framöver.<br><br>Tidig/sen till träningen - Kommer oftast 5-10 min innan passet ska börja<br><br>Smärta/skador historiskt - Lite stel/ont i ländryggen senhösten 2024.<br><br>Smärta/skada idag - Nej<br><br>Övrigt - Lisa bor i Sundbyberg, är gift med Joachim (som tränar på R30) och har tre vuxna barn. Hon har två barnbarn. Hus i Hedemora där hon gärna åker skridskor och längd under vinterhalvåret. Drejar, kulturintresserad. Tycker om att resa.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 15:28:26.444552	2024-12-30 15:28:26.444552	html
1993	notes	\N	10	{"authenticity_token"=>"7If95oNIJsSKtXru8F8U_F1i2zEEqpgg3Cw72vzYIcCS_cB253AcWvewLCtEnOk6YuJ06b3HhEO7c04i9gHR4g", "target_type"=>"Client", "target_id"=>"637", "note"=>{"text"=>"<div>Skor - Ja men hon brukar ta med sig dem hem mellan passen<br>Låda - Ja på G7<br>Mapp - Ja på G7<br><br>Startår - 2020<br><br>Svaren på de fyra frågorna -<br>1) Lite av en testare av många olika saker, stavgång, gruppträning, vandring, motionssimning, motionscykling, Osteo Strong för att stärka min benstomme mm Försöker hålla mig igång med ca 2 aktiviteter per vecka men det blir mest av typen vardagsmotion.<br>2) Simmar, går stavgång - anpassat efter Corona dock så mest utepromenader mm<br>3) Nej<br>4) Bättre muskelstyrka, grund för att hålla mig frisk (fyllde 60 (2020) i våras och är mån om min goda hälsa) samt minimera risk för att få ryggont eller liknande framöver.<br><br>Hur hittade personen till TAKKEI - Via sin svärson Elisas (som fö känner Emelie).<br><br>Övergripande Mål - Bättre muskelstyrka, grund för att hålla sig frisk, samt minimera risk för att få ryggont eller liknande framöver.<br><br>Tidig/sen till träningen - Kommer oftast 5-10 min innan passet ska börja<br><br>Smärta/skador historiskt - Lite stel/ont i ländryggen senhösten 2024.<br><br>Smärta/skada idag - Nej<br><br>Övrigt - Lisa bor i Sundbyberg, är gift med Joachim (som tränar på R30) och har tre vuxna barn. Hon har två barnbarn. Hus i Hedemora där hon gärna åker skridskor och längd under vinterhalvåret. Drejar, kulturintresserad. Tycker om att resa.<br><br>Post rörlighetspass (höst 2024): Fokus: aktiva stretcher för ÖK och UK<br><br>LK har svårt att tippa bäckenet bakåt i vissa positioner och hennes massör har sagt att det beror på att LK är stel i ländryggen. Jag känner mig inte övertygad om detta då hon kan ta ut bra rörlighet i ländryggen i vissa vinklar, flaskhalsen verkar snarare sitta i sätet och baksida lår. Jag gav LK lite tips och tricks och rekommenderade ett par vilsamma stretcher om hon vill jobba på detta själv (säte mot bänk, är nog den viktigaste). Vidare är LK ganska stel i övre delen av ryggen, framför allt skuldror/lats. LK var intresserad av att köra något mer pass i november, får man in någon annan rörlighetstränare så tycker jag man kan göra ett mixpass med några övningar för ÖK och framför allt höftöppnare och baksida lår för UK. Låg intensitet och lång tid i positionerna.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 15:29:13.63854	2024-12-30 15:29:13.63854	html
