1995	notes	\N	10	{"authenticity_token"=>"FsC1JEG-jhCFoC35kk7b4c9IeyOv0AXov1KGDPaIr773aKJHXJfbi35rRSPn6IOL1LcEzUKAp-J3CeVD_IcX4Q", "target_type"=>"Client", "target_id"=>"877", "note"=>{"text"=>"<div>Skor - Ja på T19<br>Låda - Ja på T19<br>Mapp - Ja på T19<br><br>Startår - 2023<br><br>Svaren på de fyra frågorna -<br>1) Fram till för några år sedan så skulle jag säga att jag rört på mig mycket jämfört med snittet. I amerikansk grundskola hade vi gympa varje dag. Har sedan sprungit mycket - i många många år sprang jag säkert 6 dagar i veckan (men inte så långt), i säkert 10-15 år har jag kört ett enklare pass några ggr i veckan på vårt privata gym i BRF (crosstrainer, gång i uppförsbacke, kortare löptur, lite lätta vikter, gummiband, stretch, hopp m.m.), i 6-7 spelade jag tennis några ggr i veckan. Några år till och från haft PT 1-2 ggr i veckan. Promenerar en hel del. Träningen har alltid varit mer åt konditionshållet, inte minst eftersom jag haft ont av olika slag - mycket nackproblem efter tennisen, tennisarmbåge, ledvärk osv. Tror även att jag alltid föredragit kondition inte minst eftersom jag haft lättare för det än styrka. Nu är jag 54 år och de senaste 4-5 åren har jag lagt mycket av mitt eget liv åt sidan för att istället ta hand om mina föräldrar. Jag har gått ner i deltid jobbmässigt, jag lägger sedan 30 timmar minst i veckan på att vara med min pappa (demensboende) och även stötta min mamma. Promenaden t/r (alla dagar orkar jag inte gå, bär på mat och tunga saker) från Norr Mälarstrand till Östermalm (35 minuter i varje riktning i snabb takt) gör liksom att min ork till att träna inte riktigt finns där som förr. Fötterna och benen har blivit trötta av promenaden och alla ärenden på vägen, så att springa 3-4 dagar i veckan blir för mycket. Jag behöver ta ett omtag på min träning helt enkelt och få hjälp att stärka kroppen på ett nytt sätt med utgångsprunkt i att jag ändå får så mycket vardagsmotion genom att ta mig fram och tillbaka till pappa.<br><br>2) Springer 3-5 km en till två ggr i veckan. Det går inte fort dock. Kör eget litet träningsprogram hemma. Går fortsatt mycket i snabbt tempo.<br><br>3) Ledvärk i ffa händer/fingrar. Nacken känns svag. Träffar reumatolog i nästa vecka för att se om nackvärken hänger ihop med ledvärken i händerna.<br><br>4) HÄLSA framför allt, ett bra och starkt åldrande utifrån mina förutsättningar. Hjälp att jobba med de bitar i kroppen som jag eftersatt, eftersom man gärna gör det som känns lättast och därmed roligast... Sen vill jag såklart att det gärna får synas lite. Tona armarna vore trevligt liksom att förhindra att rumpan blir allt plattare och tråkigare. Men armar och toning handlar ju mer om att isf tappa i vikt. Vill även förhindra att hållningen slappar till sig. Ser tendens till sk gamnacke och det vill jag absolut råda bot på.<br><br>Hur hittade personen till TAKKEI - Via Maria Edsman<br><br>Smärta/skador historiskt - Ledvärk i ffa händer/fingrar. Nacken.<br><br>Smärta/skada idag - Anna började under våren -24 få ont i ena armbågen. Hon kunde knappt belasta den och marklyft som brukar fungera gjorde ont. Den är nu mkt bättre men man behöver fortsatt vara försiktig med pressar och övningar OH. Nacken blev mycket bättre under våren men har känts igen efter sommaren (-24) - bra att ha den under radarn.<br><br>Fokus: smärtfri/smidig/stark/snabb -Bli smärtfri. (Hon kände att hon tappat mkt styrka efter långt uppehåll under sommaren.)<br><br>Hospitality: Anna önska omklädningsrum 3 på T19 - hon gillar det rummet väldigt mkt men var inte så förtjust i rum nr 4. Anna brukar ta en kaffe när hon kommer hit innan passet.<br><br>Övrigt - Anna är aktiv och har alltid fullt upp. Hon är gift med Håkan, och har en dotter (Nicki) som pluggar på Harvard. Anna pluggade med Maria E på Handels (det är så de känner varandra). Se ovan om livspussel.<br><br>Post rörlighetspass (okt -24): Körde fokus överkropp på rekommendation, A.E undrade även om jag kunde hjälpa henne att öka rörligheten i hålfoten. Det är inte mitt område riktigt, så jag föreslog att vi skulle hålla oss till överkropp.<br><br>Utmaningen för A.E under passet var att över huvud taget få kontakt med skuldrorna och bröstryggen, vi gjorde en liten extraövning där hon fick stå med armarna utsträckta framför sig och dra skulderbladen bakåt och neråt. Så fort hon tappade koncentrationen lite grann började kroppen automatiskt dra skulderbladen uppåt mot nacken istället för ner, så kan vara bra att ha koll på det och påminna henne att skulderbladen ska inte bara bak utan också ner för att skapa bättre förutsättningar.<br><br>Vi trixade en del med detta, men när vi väl fick ordning på det så gick övningarna bättre. A.E ville gärna boka in en ny tid i november. Hon fick som hemläxa att göra skulderbladsövningen några gånger om dagen utan belastning för att få in rörelsen, och av stretcher så skulle det inte skada at stretcha lats regelbundet.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 15:32:10.554129	2024-12-30 15:32:10.554129	html
