1997	notes	\N	10	{"authenticity_token"=>"CoOQil_FIcOshqpAtWJ7KLwuwM6vRnVYOqUvnvlNea7rK4fpQux0WFdNwprAxCNCp9G_IEIW11Ly_kzR80LB8Q", "target_type"=>"Client", "target_id"=>"867", "note"=>{"text"=>"<div>Skor - Ja på G7<br>Låda - Ja på G7<br>Mapp - Ja på G7<br><br>Startår - Augusti 2023<br><br>Svaren på de fyra frågorna -<br><br>* Kampsport. Karate och wing chun.<br>* Tränar inget idag och under lång tid bakåt.<br>* Inga skador. Inga mediciner men tar sprutor för viktnedgång (osempic).<br>* Bli mer atletisk och komma över sina trösklar för fysisk aktivitet.<br><br>Hur hittade personen till TAKKEI - Google<br><br>Övergripande Mål - Bi stark och atletisk. Första checkpoint är skidåkning vinter 2023/24<br><br>Tidig/sen till träningen - Från 10 minuter innan till några minuter sen.<br><br>Smärta/skador historiskt - Har historiskt haft två svåra diskbrock. Varav det ena opererades. Smärtfri nu (2005 och 2012).<br><br>Smärta/skada idag - Nej inte i lyftning. Känslig BR. Höger fot/hälsena kan kännas av i gymnastiken när hon är barfota. (Hon kan ha svårt med full rörlighet i foten när hon vaknar på morgonen.)<br><br>Blodtrycksfall vilket ibland kan vara begränsande (inte lika mkt nu (sep -24)). Ingen smärta.<br><br>Fokus: smärtfri/smidig/stark/snabb - Full rörlighet för KB och där ska vi bygga upp stryka. Smidig genom att bli starkare. Utveckla en bekvämare hylla.<br><br>Mediciner - Nej. osempic för viktnedgång<br><br>Övrigt -<br>Advokat med fokus på upphovsrätt.<br>Gift med Johan och har tre vuxna söner.<br>Bor i villa Bromma, hus i skärgården. Sjunger i kör.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 15:34:38.452115	2024-12-30 15:34:38.452115	html
