1999	notes	\N	10	{"authenticity_token"=>"woWW_ev-ufv6v_cMwKgNj0TWIV8dJJEy2dL16zfjVTkjLYGe9tfsYAF0n9a1DlXlXylesfB0MzgRiZakPeztZg", "target_type"=>"Client", "target_id"=>"950", "note"=>{"text"=>"<div>Skor - Ja på G7 (230)<br>Låda - Ja på G7<br>Mapp - Ja på G7<br><br>Startår - aug 2024<br><br>Svaren på de fyra frågorna -<br>1) Hur ser din (eventuella) träningsbakgrund ut?<br>Did not engage in a lot of sports growing up (typical Asian family)<br>Took up pilates in my early 20s for a bad back<br>Started training regularly in my 30s in order to track my health for work<br>Enjoy BodyPump + boot camp (occasionally HIIT) classes and mobility + yoga/pilates on my own<br><br>2) Tränar du något idag? Om ja - vad och hur mycket?<br>Have been unable to workout regularly for the last 6 months due to our move from Seoul to Stockholm<br>Been otherwise trying to target 4-5 30min workouts a week on the Sweat App: Strength, Pilates, Mobility<br><br>3) Har du några skador eller andra hälsoproblem vi behöver ta hänsyn till?<br>No chronic disease yet but genetically predisposed to diabetes and heart disease<br>A weak meniscus causing me occasional knee pain (right)<br>Lower back and right shoulder pain (started going back to my chiropractor this week: gamlastans kiropraktik)<br>Dislocated a finger in February which is still bothering me<br>Plantar Fasciitis<br>Low blood pressure, high pulse<br><br>4) Vad vill du att träningen ska ge dig i ett längre perspektiv?<br>Want to be able to get up without feeling stiff<br>Increase bone density<br>Manage peri-menopausal symptoms (increasing lower belly)<br><br><br>Hur hittade personen till TAKKEI - via mannen Daniel Wolvén<br><br>Övergripande Mål - Se ovan<br><br>Tidig/sen till träningen - brukar komma några minuter innan passet ska börja<br><br>Smärta/skador historiskt - Se ovan<br><br>Smärta/skada idag - Shampa har plantar faschiit. Det gör ont emellanåt så vi har tex skippat INF3 och kommer att avvakta med LES. Det var värre i början när hon var ny.&nbsp;<br><br>Mediciner - Inget uttalat<br><br>Övrigt - Inga problem att komma ner i sitt i KB och hon har handledsskydd för att få stöd med hyllan. Hon gillar marklyft. Shampa bor i närheten av G7 med man och två barn (man (Daniel) och son (Ayaan) tränar också hos oss).</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2024-12-30 15:45:30.050701	2024-12-30 15:45:30.050701	html
