2034	notes	\N	5	{"authenticity_token"=>"PpiKz9QwaJ_dhFv950jwTwTPaOBFIxpHVkVtgPfFqt9AGKKge_l8JKftJIWp7oDZoqBiUou4qPj4R7-oZ6-2iQ", "target_type"=>"Client", "target_id"=>"531", "note"=>{"text"=>"<div>AnB&gt;BjT<br><br>Inför vick 2/1 2025<br><br><strong>Pass: C 3:2<br><br></strong>Eftersom Björn har tränat ett tag har jag börjat ta in övningar från A och B-varv för variation och progression.<br><br><strong>Några anpassningar och progression på C-varv.<br></strong><br>- Vi kör längorna utan skor. Förutom att köra gång på tå och häl har jag lagt till insida och utsida som i GYMN. Därefter sätter vi på skor och kör uppvärmning med stav.<br>- Vi kör serie 0 på +2 klack. Han får ut rörligheten i bakåtböjning och ovan huvud bättre då.<br>- Vi kör även SKB i uppvärmningen på +2 klack och med 5 kg ovan huvud för rakare linje ner.<br>- Hoppar inte i uppvärmningen med honom.<br><br>- Kör KB&gt;PR och KB&gt;UTF+PR med med stång istället för hantel numera.<br>- Stötkombon är den vanliga i C-varvet.<br>- Stället för resning från bänk kör vi styrkevänd från P3.<br><br><strong>Fokus: </strong>Tema. Att skapa tålighet för belastning. <br><br>- Nu har vi haft en period av flera veckor utan avbrott. Periodvis reser han mycket och länge vilket såklart påverkar planering och viktsättning. Den trånga sektorn är rörlighet i bröstrygg och ovan huvud. Se till att han har handledsskydd i KBF och i APR. Blir bättre hylla och driv mot stången med kroppen.<br><br>- I UKB föreslår jag att du <strong>endast kör med stången på ryggen </strong>istället för fram och ovan huvud. Mer effektivt för att bygga styrka och benkapacitet.<br><br>- <strong>Prioritera axelpress som övning.</strong> Se till att han inte lutar sig bakåt utan står rakt och rundar huvudet på vägen upp istället för att ta ut rörligheten i ländryggen.</div>"}, "button"=>"", "controller"=>"notes", "action"=>"create"}	2025-01-01 13:47:29.22097	2025-01-01 13:47:29.22097	html
